	(257, 257, 'ec3m3qQntVA', 'Impressora 3D Simples | Parte 1 | Como fazer uma impressora 3D mais barata do que a impressora comum', 'Projeto BT4\nImpressora 3D simples\nVolume de impress√£o: 140x130x100 (comprimento x largura x altura em mm)\n\nArquivos:\n\nhttps://drive.google.com/drive/folders/0B69KEXPVHfbSMl9Rc2d6U1J4ZGM?usp=sharing\n\nQuanto custa uma Impressora 3D?\nAlguns exemplos.\n\nAs impressoras comuns s√£o bem mais baratas.\nA produ√ß√£o em larga escala reduz o custo.\n\nQuanto custa uma impressora auto-replic√°vel?\nAs pe√ßas pl√°sticas s√£o caras.\n\nE fazer uma impressora simples?\nBem b√°sica.\n\n√â poss√≠vel fazer uma impressora 3D pelo custo de uma impressora comum?\nPor exemplo, usando pe√ßas padr√µes e adaptando o motor.\n\nLista de pe√ßas.\nCusto estimado $50.\n\nEste √© o projeto BT4.\n\nLista de pe√ßas:\nArduino Mega 2560  1 pc\nRamps 1.4  1 pc\nStepper driver A4988  4 pc\nStepper motor 28BYJ-48 5V  4 pc\nPower supply   12V, 10A 1 pc\nPulley GT2 20 teeth, inner √ò5mm 2 pc\nBelt GT2 0,5m, T2.5 0,5 m\nBearing 624ZZ √ò13x5mm, √ò4mm 2 pc\nBearing LM8UU √ò15x24mm, √ò8mm 9 pc\nSmooth rod  Stainless D8, 250mm, √ò8mm 6 pc\nThreaded rod  Stainless M5, 250mm, √ò5mm 1 pc\nEndstop  Microswitch 3 pc\nHotend E3D V5 1.75mm filament, 0.4mm nozzle 1 pc\nFan cooler  12V, 30x30x10mm 1 pc\nFan Housing E3D V5  1 pc\nPTFE Tube  Outter √ò4mm, inner √ò3mm, 1m\nDriver gear MK8   1 pc', '00:00:00', 'ec3m3qQntVA', 'video/youtube', 'https://i.ytimg.com/vi/ec3m3qQntVA/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC8nhvBNtxW3xy68aKJnCFGQ', '2019-05-07 01:13:12', 108, '2022-08-15 15:08:36', '2022-08-15 15:08:36'),
	(258, 258, 'afNIlMh4ecw', 'Impressora 3D  Simples | Parte 2 | Como instalar e testar o Arduino | Mega | ATmega 2560', 'Projeto BT4.\n\nTestando o Arduino.\n\nO LED pisca a cada um segundo.\n\nEste aplicativo altera a programa√ß√£o do Arduino.\n\nAlterando o intervalo para cinco segundos.\n\nMontagem do escudo e driver do motor.', '00:00:00', 'afNIlMh4ecw', 'video/youtube', 'https://i.ytimg.com/vi/afNIlMh4ecw/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC8nhvBNtxW3xy68aKJnCFGQ', '2019-05-07 01:14:16', 108, '2022-08-15 15:08:36', '2022-08-15 15:08:36'),
	(259, 259, 'Lh8I8afy6rg', 'Impressora 3D Simples | Parte 3 | Adaptar motor 28BYJ-48 5V unipolar para bipolar', 'Projeto BT4.\n\nAdaptando o Motor para bipolar.\n\nInterrompendo a trilha.\n\nTestando a continuidade.\n\nEliminando o excesso.\n\nNova sequ√™ncia de fios.', '00:00:00', 'Lh8I8afy6rg', 'video/youtube', 'https://i.ytimg.com/vi/Lh8I8afy6rg/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC8nhvBNtxW3xy68aKJnCFGQ', '2019-05-07 01:15:20', 108, '2022-08-15 15:08:36', '2022-08-15 15:08:36'),
	(260, 260, 'S6pdx0yLe4s', 'Impressora 3D Barata Lista De Materiais', 'Mais um super projeto est√° come√ßando hoje, √© a nossa primeira impressora 3D do canal nesse v√≠deo mostro a voc√™s todas as pe√ßas necess√°rias para a montagem, da impressora 3D incluindo todas as pe√ßas para a montagem do frame da mesmo n√£o se gostou deixe seu like e continue seguindo canal para mais v√≠deos sobre impressora.\n\nLink da desenho: http://bit.ly/2K0GjEZ\nLink da planilha com a lista de pe√ßas: https://goo.gl/Xn8pA8', '00:00:00', 'S6pdx0yLe4s', 'video/youtube', 'https://i.ytimg.com/vi/S6pdx0yLe4s/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC8nhvBNtxW3xy68aKJnCFGQ', '2019-05-07 01:20:24', 108, '2022-08-15 15:08:36', '2022-08-15 15:08:36'),
	(261, 261, '5rlT8NTovh8', 'IMPRESSORA 3D CASEIRA. Muito simples.', 'PE√áAS PRINCIPAIS INSUBSTITU√çVEIS.\n\n12 Rolamentos Lm8uu R$63,99 (Mercado livre)\n1 Acoplamento Flex√≠vel 5mm*8mm R$ 15,90 (Mercado Livre)\n3 polias mais 2 metros de correia GT2 R$ 49,90 (Mercado Livre)\n3 Endstop R$30,00 (Mercado livre)\nkit hotend + 2 MK8 + 5 bicos 0,5 R$ 139,00 (Mercado Livre)\n1 Mesa aquecida + 1 Placa de controle 3D LCD Full graphics R$ 81,62(Banggood)\n2 Eixo retificado 8mm fresa 1M Cada R$ 48,00 (Mercado Livre)\n1 Tubo ptfe 1M R$7,99 (Mercado Livre)\n1 Fonte 12V 30A 360W R$ 46,89 (Mercado Livre)\n1 Fuso T8 + Castanha bronze R$ 72,00 (Mercado Livre)\n1 kit com raps 1.4 + arduino mega 2560 + 4 Driver A4988 + dissipadores R$ 80,41 (Banggood)\n\nAT√â AQUI TOTAL DE 636,70 o desenho da estrutura foi elaborado para o motor nema 17 por√©m os pre√ßos deles mudam de acordo com a for√ßa, eu usei os de 4,7 Kg/f\nmas n√£o √© necess√°rio tudo isso, escolhendo motores mais fracos fica ainda mais barato.\n\nO projeto original antes de todas as altera√ß√µes que fiz era menor e utilizava um motor mais simples, eu at√© consegui fazer\nfuncionar mas n√£o foi muito satisfat√≥rio, e com base no projeto desse rapaz eu criei o meu do zero.\n\nlink do projeto original: https://www.youtube.com/channel/UCANTu2DwiGg0YkQu_2aPpNA/videos\n\nA estrutura pode ser feita em madeira que sair√° bem mais barata por√©m qualquer erro em corte e furo pode fazer diferen√ßa, \npor isso eu levei em uma empresa e fiz o corte em m√°quina CNC de acr√≠lico de 3mm para as pe√ßas de mesas e de 10mm para a base.\n\nPra mim saiu R$ 150,00 todas as pe√ßas cortadas em acr√≠lico.\n\nComprei uma caixa de ferramentas opcional para ficar est√©ticamente melhor.\n\nCONFIGURA√á√ÉO DO ARDU√çNO QUE USO ATUALMENTE NA MINHA IMPRESSORA, NO MARLIN.\n\n// Mechanical endstop with COM to ground and NC to Signal uses "false" here (most common setup).\n#define X_MIN_ENDSTOP_INVERTING true // set to true to invert the logic of the endstop.\n#define Y_MIN_ENDSTOP_INVERTING true // set to true to invert the logic of the endstop.\n#define Z_MIN_ENDSTOP_INVERTING true // set to true to invert the logic of the endstop.\n#define X_MAX_ENDSTOP_INVERTING false // set to true to invert the logic of the endstop.\n#define Y_MAX_ENDSTOP_INVERTING false // set to true to invert the logic of the endstop.\n#define Z_MAX_ENDSTOP_INVERTING false // set to true to invert the logic of the endstop.\n#define Z_MIN_PROBE_ENDSTOP_INVERTING false // set to true to invert the logic of the endstop.\n\n\n// Invert the stepper direction. Change (or reverse the motor connector) if an axis goes the wrong way.\n#define INVERT_X_DIR false\n#define INVERT_Y_DIR false\n#define INVERT_Z_DIR false\n\n// @section extruder\n\n// For direct drive extruder v9 set to true, for geared extruder set to false.\n#define INVERT_E0_DIR true\n#define INVERT_E1_DIR false\n#define INVERT_E2_DIR false\n#define INVERT_E3_DIR false\n\n// default settings\n\n#define DEFAULT_AXIS_STEPS_PER_UNIT   {80, 80, 199.004, 142.85} // X, Y, Z and E\n#define DEFAULT_MAX_FEEDRATE          {300, 300, 50, 25}   // (mm/sec)\n#define DEFAULT_MAX_ACCELERATION      {3000, 3000, 100, 10000}   //  X, Y, Z, E maximum start speed for accelerated moves. E default values are good for Skeinforge 40+, for older versions raise them a lot.\n\n#define DEFAULT_ACCELERATION          3000   // X, Y, Z and E acceleration in mm/s^2 for printing moves\n#define DEFAULT_RETRACT_ACCELERATION  8000      // E acceleration in mm/s^2 for retracts\n#define DEFAULT_TRAVEL_ACCELERATION   3000    // X, Y, Z acceleration in mm/s^2 for travel (non printing) moves\n\n// The speed change that does not require acceleration (i.e. the software might assume it can be done instantaneously)\n#define DEFAULT_XYJERK                20.0    // (mm/sec)\n#define DEFAULT_ZJERK                 0.4     // (mm/sec)\n#define DEFAULT_EJERK                 5.0    // (mm/sec)', '00:00:00', '5rlT8NTovh8', 'video/youtube', 'https://i.ytimg.com/vi/5rlT8NTovh8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC8nhvBNtxW3xy68aKJnCFGQ', '2019-05-07 01:22:02', 108, '2022-08-15 15:08:36', '2022-08-15 15:08:36'),
