	(264, 264, 'id90y5fkirE', '3D Printing Beginners Guide (Hardware) - 380$ DIY RepRap Prusa I3', 'Previous video: https://youtu.be/AwcQsbgy7AY\nFacebook: https://www.facebook.com/greatscottlab\nTwitter: https://twitter.com/GreatScottLab\nSupport me for more videos:  https://www.patreon.com/GreatScott?ty=h\nPrusa I3 Printer (affiliate link): https://s.click.aliexpress.com/e/_dV1RcY7\n\nSince half an year I have been playing around with a Prusa I3 3D Printer. In this video I will present you all my experiences and problems I had with 3D Printing and the Prusa I3 kit itself. It should give you an overview of what you can expect from such a cheap kit.\n\nMusic:\n2011 Lookalike by Bartlebeats\nKilling Time, Kevin MacLeod  (incompetech.com)', '00:00:00', 'id90y5fkirE', 'video/youtube', 'https://i.ytimg.com/vi/id90y5fkirE/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC8nhvBNtxW3xy68aKJnCFGQ', '2019-05-07 01:48:32', 108, '2022-08-15 15:08:37', '2022-08-15 15:08:37'),
