	(295, 295, 'MfOWQIDE0Uw', 'Impressora 3D caseira #10 - Configurando o Marlin', 'Chegou a hora de iniciar uma nova etapa no projeto da impressora 3D caseira, a configura√ß√£o e calibra√ß√£o. Nesse v√≠deo vou mostrar as configura√ß√µes iniciais que eu usei no meu projeto e explicar como calcular os steps de cada eixo da impressora.\nMais conte√∫do no site http://hardware.rbtech.info/impressora-3d-caseira-configuracao-calibracao/\n\nAcompanhe o RBtech: http://rbtech.info/siga/', '00:00:00', 'MfOWQIDE0Uw', 'video/youtube', 'https://i.ytimg.com/vi/MfOWQIDE0Uw/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCydnENu8reGSdzfBjW0bfDw', '2021-06-16 11:04:26', 118, '2022-10-10 14:29:52', '2022-10-10 14:29:52'),
