	(297, 297, '6OBLGEKCrvA', 'Impressora 3D caseira #12 - Imprimindo a primeira pe√ßa', 'Veja nesse v√≠deo com fazer a calibra√ß√£o da sua impressora 3d imprimindo um cubo de verifica√ß√£o para acertar sua m√°quina e deix√°-la com a precis√£o ideal. Al√©m de preparar a pe√ßa voc√™ vai aprender como nivelar a mesa para come√ßar a imprimir.\nMais conte√∫do no site http://hardware.rbtech.info/impressora-3d-caseira-configuracao-calibracao/\n\nAcompanhe o RBtech: http://rbtech.info/siga/', '00:00:00', '6OBLGEKCrvA', 'video/youtube', 'https://i.ytimg.com/vi/6OBLGEKCrvA/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCydnENu8reGSdzfBjW0bfDw', '2021-06-16 11:04:34', 118, '2022-10-10 14:29:52', '2022-10-10 14:29:52'),
