	(551, 551, 'DxqqcW_wFPM', 'Build a Blog with Laravel [8,9] #0 - Introduction', 'Laravel is one of the most popular frameworks to create a variety of websites. You can create portfolio websites, admin dashboards, e-commerce websites, and more. Most importantly, you can create blogs with Laravel. This, however, would require setting up a database and an admin dashboard to be able to enter the posts and their content and then display them.\nIn this series, you will learn how to create a blog with Laravel.\n\nRecently, the Laravel 9 version has been launched. In this video, we will take some simple steps to install Laravel 9 on Windows. We need to make sure that our server meets the Laravel 9 requirements.\n\nTo Install Laravel 9, you can install Xampp then Composer and finally install Laravel 9.\n\nClick  Download Composer from www.getcomposer.org: \nhttps://getcomposer.org/download/\n\nClick here to download git:\nhttps://git-scm.com/downloads\n\nClick here to download Visual Studio Code:\nhttps://code.visualstudio.com/download\n\nClick here to download XAMPP:\nhttps://www.apachefriends.org/\n\nBest choice of cheap hosting for you is Namecheap:\nhttps://namecheap.pxf.io/Gj7DJk', '00:00:00', 'DxqqcW_wFPM', 'video/youtube', 'https://i.ytimg.com/vi/DxqqcW_wFPM/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC2jMlBL-BKi088jYaT_Q2aA', '2022-04-18 01:06:33', 81, '2022-10-24 23:58:04', '2022-10-24 23:58:04'),
	(552, 552, 'pGNW7e1LaMI', 'Build a Blog with Laravel [8,9] #1 - Download and Install Laravel 9', 'Recently, the Laravel 9 version has been launched. In this video, we will take some simple steps to install Laravel 9 on Windows. We need to make sure that our server meets the Laravel 9 requirements.\n\nTo Install Laravel 9, you can install Xampp then Composer and finally install Laravel 9.\n\nClick  Download Composer from www.getcomposer.org: \nhttps://getcomposer.org/download/\n\nClick here to download git:\nhttps://git-scm.com/downloads\n\nClick here to download Visual Studio Code:\nhttps://code.visualstudio.com/download\n\nClick here to download XAMPP:\nhttps://www.apachefriends.org/\n\nBest choice of cheap hosting for you is Namecheap:\nhttps://namecheap.pxf.io/Gj7DJk', '00:00:00', 'pGNW7e1LaMI', 'video/youtube', 'https://i.ytimg.com/vi/pGNW7e1LaMI/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC2jMlBL-BKi088jYaT_Q2aA', '2022-04-09 10:45:12', 81, '2022-10-24 23:58:04', '2022-10-24 23:58:04'),
	(553, 553, '1Sfe0p3eE5E', 'Build a Blog with Laravel [8,9]  #2 - Create Virtual Host for laravel project on Xampp', 'As we all know how much important it is to have virtual host for any of your projects . If you have virtual host for your projects you will not have to think about running the php artisan server every time you want to make changes in the project. The virtual host will give you the domain for your local on which you can run your project every time and that domain will be limited to your machine only and will not be public.\n\nso the question is how you can create a virtual host now . by following this video, you will be able to create your own virtual host.', '00:00:00', '1Sfe0p3eE5E', 'video/youtube', 'https://i.ytimg.com/vi/1Sfe0p3eE5E/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC2jMlBL-BKi088jYaT_Q2aA', '2022-04-10 07:46:00', 81, '2022-10-24 23:58:04', '2022-10-24 23:58:04'),
	(554, 554, 'wffICBEB-uk', 'Build a Blog with Laravel [8,9] #3 - Setup dot env file and database', 'In this video, we will see how we can setup .env file and create database\n\nBest choice of cheap hosting for you is Namecheap:\nhttps://namecheap.pxf.io/Gj7DJk', '00:00:00', 'wffICBEB-uk', 'video/youtube', 'https://i.ytimg.com/vi/wffICBEB-uk/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC2jMlBL-BKi088jYaT_Q2aA', '2022-04-12 08:10:05', 81, '2022-10-24 23:58:04', '2022-10-24 23:58:04'),
	(555, 555, '5eO2cDsbLQA', 'Build a Blog with Laravel [8,9] #4 - Organize Routes and Folders', 'In Laravel, all requests are mapped with the help of routes. Basic routing routes the request to the associated controllers.\nIn this video, we will organize routes and folders', '00:00:00', '5eO2cDsbLQA', 'video/youtube', 'https://i.ytimg.com/vi/5eO2cDsbLQA/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC2jMlBL-BKi088jYaT_Q2aA', '2022-04-16 09:10:36', 81, '2022-10-24 23:58:04', '2022-10-24 23:58:04'),
