	(560, 560, 'Y71SN23jIoI', 'Build a Blog with Laravel [8,9] #9 - Login with Email Or Username in one field', 'Let\'s start with how to login with username or email in laravel 8/9 with livewire. I will give you simple solution of Laravel\n8/9 Login with username or email in authentication.', '00:00:00', 'Y71SN23jIoI', 'video/youtube', 'https://i.ytimg.com/vi/Y71SN23jIoI/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC2jMlBL-BKi088jYaT_Q2aA', '2022-04-29 09:39:04', 81, '2022-10-24 23:58:04', '2022-10-24 23:58:04'),
	(561, 561, '6_r1_Jz5u5E', 'Build a Blog with Laravel [8,9] #10 - Forgot & Reset Password', 'Most web applications provide a way for users to reset their forgotten passwords. This password reset link will help when the users forgot their password. In the reset link, there will be generally a token and that token needs to be validated.\n\n- Mailtrap - Email Testing Tool #1:\n  https://mailtrap.io/\n\n- Simple way to send email in Laravel 8:\n  https://youtu.be/CYzqw3gHhJ0\n\n- Custom Forgot and Reset Password on Laravel 8 Multi Guards:\n  https://youtu.be/SuIQ20H-hc4\n\n- Send email with Phpmailer in Laravel 8:\n  https://youtu.be/oi6DsrhFVzM', '00:00:00', '6_r1_Jz5u5E', 'video/youtube', 'https://i.ytimg.com/vi/6_r1_Jz5u5E/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC2jMlBL-BKi088jYaT_Q2aA', '2022-05-10 09:22:57', 81, '2022-10-24 23:58:04', '2022-10-24 23:58:04'),
