	(576, 576, 'fvCF6S1Vm_8', 'Does the Bellus3D Scanning App Work? Testing on Prusa SL1', 'Bellus3D offers a NO LONGER FREE APP to scan your face, and export an STL that will help fit a mask better. I printed it on the Prusa SL1 resin 3d printer to see if it works - https://www.bellus3d.com\n\n3D Printer: Prusa SL1\nhttp://3d.pn/sl1\n\nFREE Smart Vehicle Health Monitor Mini\nhttp://gtgkd.co/nonda-3DPrintingNerd3\n\n#3dprinting #facemask #bellus3d\n\nYou can support what we do in many way!\nBuy me a coffee: http://buymeacoff.ee/3dprintingnerd\nKo-fi: http://www.ko-fi.com/joeltelling\nPatreon: http://3d.pn/patreon\nFloatplane: https://www.floatplane.com/channel/3dprintingnerd\n\nFollow Sean Connelly on Patreon:\nhttps://www.patreon.com/theseanconnelly\n\nFollow David Tobin on Instagram\nhttps://www.instagram.com/david_tobin\n\nSome of the following are affiliate links:\nAmazon (aff): https://geni.us/shopatamazon\nRaise3D: http://raise3d.com\nMagigoo: http://thought3d.com\nMatterhackers BUILD series filaments (aff) : http://3d.pn/mhbuild\nMatterhackers 3D Printers (aff) : http://3d.pn/mhprinters\nProto Pasta (aff): http://3d.pn/protopasta\nPrusa (aff): http://3d.pn/prusa\nPuget Systems: http://3d.pn/pugetsystems\nChannel Merch Shop : http://3d.pn/shop\n\n--------------------------------\nFind Me Socially!\n--------------------------------\nTwitch : http://twitch.tv/joeltelling\nTwitter : http://twitter.com/joeltelling\nFacebook : http://facebook.com/3dprintingnerd\nInstagram : http://instagram.com/joeltelling\nDiscord: https://discord.gg/GGZQgnh\n\n--------------------------------\nWant to send me something?\n--------------------------------\n3D Printing Nerd\nPO Box 55532\nShoreline, WA 98155\nUSA\n\nMusic provided by https://futurevega.sourceaudio.com\nRoyalty Free Music by http://www.audiomicro.com/royalty-free-music\n\nFTC Disclaimer: A percentage of sales is made through Affiliate links', '00:00:00', 'fvCF6S1Vm_8', 'video/youtube', 'https://i.ytimg.com/vi/fvCF6S1Vm_