	(577, 577, 'NU1kYEE3qrQ', 'How to Control Seams In Cura Slicer Settings', 'The seam on a 3D print is often visible. Its where the layer height changes while 3D printing. Chuck shows you how to control seams in Cura Slicer. There are settings to make seams mostly disappear and settings to put it on a specific location. All the settings in Cura Slicer are explained in this episode of Filament Friday.\n\nCreality Ender 3 Upgrade Package (Extruder, Silent Board & Capricorn Tubing): https://bit.ly/2MNvmcs\n\nCHEP Cura Profiles:\nhttps://www.chepclub.com/cura-profiles.html\n\nSpiderman Bust: https://www.thingiverse.com/thing:1692007\n\n*************** 3D Printers & Parts *******************************\n\nCreality Ender 3: \nFrom Banggood : https://bit.ly/2wfD5Ia  \nFrom  : https://amzn.to/2VoA4zV  \n\nFrom MatterHackers: https://bit.ly/2VVveZW\nCreality Official Reseller Comgrow: https://bit.ly/3hDTvSf\n\nCR-10S Pro \nFrom Banggood : https://bit.ly/2WXWasO\nFrom   : https://amzn.to/2U3BTBz\nFrom Matterhackers: https://bit.ly/2Kwk3G6\nCR10 Mini\nFrom Banggood :  https://bit.ly/2u5XNJk\nFrom  .com :  https://amzn.to/2l8B7mX\nCreality Ender 3X - Creality Ender 3 plus Glass Bed and 5 Extra Nozzles:\nCreality Official Reseller Comgrow: https://bit.ly/2NguWOD\n\nCR-10:\nFrom Banggood : https://bit.ly/2udpwaj \nFrom   :  https://amzn.to/2s899uZ\nCreality Ender 5:\n .com: https://amzn.to/2IZaEFy\nBanggood.com: https://bit.ly/2PwwHV7\n\nCreality Official Reseller Comgrow: https://bit.ly/2L2SweG\n\nCreality Ender 3 Pro:\nFrom Banggood.com:  https://bit.ly/2DBG0AI\nFrom  .com:  https://amzn.to/2QUjRUL\nFrom MatterHackers: https://bit.ly/2MfPCFT\nCreality Official Reseller Comgrow: https://bit.ly/3hET7CL\n\nFilament Friday Tool Kit: https://amzn.to/2MOR00X\nFilament Friday 3D Printer Starter Kits: https://bit.ly/2EuojUq\nFilament Friday Filament: https://amzn.to/2rgz3Ma\n\nCreality Ender 3/CR-10 Parts:\n‚Äî‚Äî‚Äî‚Äî‚Äî‚Äî‚Äî‚Äî‚Äî‚Äî‚Äî\nPTFE Coupling: https://amzn.to/2BJDog1\nCapricorn Tubing: https://amzn.to/2nI2ipS\nCR10/Ender3 Silicon Heater Block Cover: https://amzn.to/2PaxJ89\nCR10/Creality Ender 3 Nozzles: https://amzn.to/2l7ApcC\nBanggood:https://bit.ly/2RVZySM\nSolder Sleeve Kit: https://amzn.to/2Pqqngm\nCreality Ender 3 Fan Set (24v): https://amzn.to/38u9aOl\nCR-10 Fan Set (12v): https://amzn.to/2PrcCxK\nT-Nuts Kit: https://amzn.to/2LsQZg8\nScrew Kit: https://amzn.to/2Va8uGK\n\nGeeetech A10:\nFrom Banggood: https://bit.ly/2PfgC8u\nFrom  : https://amzn.to/2SsVzxD\n***** Support the Channel ******************\nEBAY USA: http://ebay.to/1wtxfiU\nEBAY UK: http://ebay.eu/2qdC5iy\nEBAY Canada: http://bit.ly/2qdGRwh\n\nSupport the Channel here and Shop at MatterHackers.com and you automatically donate to the channel at no cost to you:\nhttp://bit.ly/1Ugcijp\n\nBuy thru this link to Slice Engineering for the Best Hot Ends:\nhttps://bit.ly/3yuyuze\n\nNote:\nAs an Amazon Associate, I earn from qualifying purchases.\n\nFinancial Support through Patreon:\nhttps://www.patreon.com/elproducts\n\n\n****************************************************\nFilament Friday Sticker:\nSend Self Addressed Stamped Envelope to:\nElectronic Products\nPO Box 251\nMilford, MI 48381\n****************************************************\n\nFilament Friday Playlist:\nhttps://goo.gl/yJLNhr\n\nChuck\'s Arduino Book:\nhttps://amzn.to/3tA31JP\n\nIntro animation by Pablo Licari based on Filament Friday Logo by Brian Carter.', '00:00:00', 'NU1kYEE3qrQ', 'video/youtube', 'https://i.ytimg.com/vi/NU1kYEE3qrQ/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCuYmw83Uj5DCICDRGIRlZeg', '2020-09-10 09:55:06', 198, '2022-10-25 01:03:51', '2022-10-25 01:03:51'),
	(578, 578, 'n9tZIFfM14o', '3D Print a Magnetic Switch, and how it works', 'Thanks for watching, here is the purchase link for the printable STL files for the magnetic switches:\n\nhttps://www.in-kleind.com/store/3D-Printable-Files-for-Magnetic-Switches-p135898046', '00:00:00', 'n9tZIFfM14o', 'video/youtube', 'https://i.ytimg.com/vi/n9tZIFfM14o/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCuYmw83Uj5DCICDRGIRlZeg', '2021-03-02 01:21:27', 198, '2022-10-25 01:03:51', '2022-10-25 01:03:51'),
	(579, 579, '3yIebnVjADM', 'How to tune your slicer settings featuring Ender 3 - UPDATE IN DESCRIPTION', 'UPDATE: This video is quite old now and I\'ve since created a completely free and open source website that allows you to generate calibration tests like this for ANY 3D printer: https://teachingtechyt.github.io/index.html\nDetails here: https://youtu.be/9kDK7czgMxc\n\nI get frequent requests for slicing profiles, so I‚Äôd thought it might be worth a video showing ways you can take a profile and tweak it for better results.\n\nThis video covers extruder calibration, flow rate/extrusion multiplier calibration, temperature, speed and retraction calibration. If you have an Ender 3 you can download and run the g-code from the link below. Most others printers can do the same, assuming they don‚Äôt have a really small bed.\n\nEdit: As several have pointed out, my speed conversion was wrong. The speed test goes from 3000 to 6000 mm / min, which is 50 mm/sec to 100 mm/sec every 5 mm. The outline is slowed by 50%, hence the need to slice it hollow so you can see the full speed on the inside walls.\n\nEdit2: Clever people have pointed out that a minimum layer time setting was preventing the speed test gcode from running properly. The gcode has now been updated in the Thingiverse link.\n\nI\'ve also added my FFF file for Simplify3D.\n\nPurchase the Ender 3 from these links:\nEnder 3 Pro Banggood ($30 off with coupon 1d1c08): http://bit.ly/2OUcEyS\nEnder 3 Banggood (US warehouse, Coupon: f2bf59): http://bit.ly/2Efoi6B\nEnder 3 Pro Amazon: https://amzn.to/2DpkbEs\nEnder 3 Amazon: https://amzn.to/2xyJ23s\nEnder 3X (glass bed version): https://amzn.to/2I7dG85\n\nTeaching Tech Speed test, my Ender 3 Simplify3D profile and all my gcode from this video: https://www.thingiverse.com/thing:3071464\nMicro all in one 3D print test: https://www.thingiverse.com/thing:2975429/\nHeat tower: https://www.thingiverse.com/thing:2223651/\nBasic retraction test: https://www.thingiverse.com/thing:2563909/\nSimplify3d print troubleshooting guide: https://www.simplify3d.com/support/print-quality-troubleshooting/\n\nBuy quality and affordable filament from X3D. Buy 3, get 1 free and a free sample pack with every order: www.x3d.com.au\n\nGearbest affiliate link (help support the channel): https://www.gearbest.com/?lkid=13807527\n\nTake a look around and if you like what you see, please subscribe.\n\nSupport me on Patreon: http://www.patreon.com/teachingtech\n\n#3Dprinting #ender3 #calibration', '00:00:00', '3yIebnVjADM', 'video/youtube', 'https://i.ytimg.com/vi/3yIebnVjADM/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCuYmw83Uj5DCICDRGIRlZeg', '2021-03-05 10:23:51', 198, '2022-10-25 01:03:51', '2022-10-25 01:03:51'),
	(580, 580, 'RZRY6kunAvs', 'Best method for 3D printer bed levelling', 'Bed leveling doesn\'t have to be hard! Here\'s a quick and easy technique that will get you near perfect results. Works with any 3D printer!\n\nPrinting squares in each corner is much more reliable and you can get near perfect first layer after printing a batch or two. This is especially useful with manual levelling beds, but it also works great if you have a 3D printer with automatic bed levelling.\n\nOctoprint CR-10 leveling plugin:\nhttps://plugins.octoprint.org/plugins/CR10_Leveling\n\n* Printable models *\nMini Trash Can:\nhttps://www.thingiverse.com/thing:1902152\n\nLevelling knob:\nhttps://www.thingiverse.com/thing:2408748\n\nWedge jack:\nhttps://www.thingiverse.com/thing:2168244\n\nCalibration squares (various sizes):\nhttps://www.thingiverse.com/thing:2789086\n\n* Get in touch *\nhttps://hobbyhoarder.net\nhttps://twitter.com/HobbyHoarder\nhttps://www.reddit.com/r/hobbyhoarder\n\n* Support me *\nIf you\'d like to show your appreciation, you can use my Amazon affiliate link whenever you\'re making a purchase. Nothing changes on your end; you pay exactly the same, but I get a small percentage from Amazon in return.\n\nAmazon (US / Germany link):\nhttp://geni.us/qpPzEQh\n\n* Ko-fi (for small donations) *\nhttps://ko-fi.com/hobbyhoarder', '00:00:00', 'RZRY6kunAvs', 'video/youtube', 'https://i.ytimg.com/vi/RZRY6kunAvs/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCuYmw83Uj5DCICDRGIRlZeg', '2021-03-12 09:53:22', 198, '2022-10-25 01:03:51', '2022-10-25 01:03:51'),
	(581, 581, '38PkynA1uGI', 'Anet A8 (Plus) Marlin 2.0 Installation Upgrade', 'Anet A8 (Plus) Marlin 2.0 Installation Upgrade\n\nIn this video, I show you how to install Marlin 2.0 firmware on the Anet A8 or the Anet A8 plus using Visual Studio Code and Platform IO as well as the new Auto Build Marlin plugin, which makes this a much easier process. Also you will see some troubleshooting tips.\n\nRead the blogpost here, if you prefer a written version: https://www.crosslink.io/2020/03/19/anet-a8-plus-marlin-2-0-installation-upgrade/\n\n*** Get the Anet A8 here\nüõí Amazon: https://geni.us/aneta8\n\n*** Videos referred to in this video:\nShould you upgrade to Marlin 2.0?\nhttps://youtu.be/rjRmBbuN6iA\n\nHow to install a bootloader on the Anet A8 using an Arduino UNO\nhttps://youtu.be/RQIizXtf9oo\n\nHow to install a bootloader on the Anet A8 using a programmer device\nhttps://youtu.be/wRODgnAqp1A\n\nHow to use Mesh Bed Leveling on the Anet A8\nhttps://youtu.be/ADdzKyS-T3w\n\nMy blogpost about memory usage of Marlin on 8Bit boards and how to fix size issues\nhttps://www.crosslink.io/marlin-2-0-memory-usage-by-feature/\n\n*** Programmer devices for flashing a bootloader\nUSBAsp\nhttps://geni.us/usbasp\n\nUSBTinyISP\nhttps://geni.us/usbtinyisp\n\n10 pin to 6 pin adapter\nhttps://geni.us/10to6pinadapter\n\n*** Software links\nMarlin firmware\nhttps://github.com/MarlinFirmware/Marlin\n\nMarlin Default Configuration Files\nhttps://github.com/MarlinFirmware/Configurations\n\nVisual Studio Code\nhttps://visualstudio.microsoft.com/\n\nTHE PRINTERS I USE: https://kit.co/danielcrosslink/the-3d-printers-i-use\nMY MERCH: https://crosslink.io/shop\n\nBECOME A PATRON: https://www.patreon.com/crosslink\nCHAT ON DISCORD: https://discord.gg/ne3J4Rf\n\nBUSINESS INQUIRIES ONLY (OR IF YOU WANT TO SEND SOMETHING) - DANIEL@CROSSLINK.IO\n\nFOLLOW ME:\nINSTAGRAM - https://instagram.com/danielcrosslink\nTWITTER - https://twitter.com/danielcrosslink\nFACEBOOK - https://facebook.com/danielcrosslink\nWEBSITE: https://crosslink.io\n\nThe Music I use: https://crosslink.io/es, AMAZING for YouTubers!\n\nGEAR USED\nhttps://kit.co/danielcrosslink/my-video-gear\n\nDisclaimer: As an Amazon Associate I earn from qualifying purchases.', '00:00:00', '38PkynA1uGI', 'video/youtube', 'https://i.ytimg.com/vi/38PkynA1uGI/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCuYmw83Uj5DCICDRGIRlZeg', '2021-03-25 07:28:01', 198, '2022-10-25 01:03:51', '2022-10-25 01:03:51'),
	(582, 582, '3jm0zzIneFc', 'How To Install a Bootloader on the Anet A8 3D Printer', 'Some Anet A8 3D printers may ship without a bootloader on board, making it difficult to install firmware updates. If this describes your printer, you may wonder: can you install a bootloader using a Mac? Yes, of course you can. Let me show you how.\n\n*NOTE*\nInstalling a bootloader erases the existing firmware on your 3D printer. After installing a bootloader, you must then install firmware. Follow one of these videos to do it. If the video covering the firmware you want to install is not ready yet, please wait to do this installation.\n\nFIRMWARE INSTALLATION VIDEO LINKS:\nInstall factory firmware on the Anet A8 3D Printer: https://youtu.be/1lnST6WgdVw\nInstall Marlin 1.1.9 firmware on the Anet A8 3D Printer: https://youtu.be/V7_zIQALk6E\nInstall Klipper firmware on the Anet A8 3D Printer: https://youtu.be/EX8dJkdcmJQ\n\nHuge thanks to Mark Corliss (Corliss Media 2.0) for generously covering the cost of the Anet A8 used in this episode. We\'ll be using it in a series of episodes where we install the Klipper firmware, and the first step is making sure we have a bootloader on board!\n\nHARDWARE AND SOFTWARE LINKS:\nUSBasp AVR Programmer Device\n‚Ä¢ https://amzn.to/2XrWiG3 [Affiliate Link]\n\n10Pin to 6Pin Adapter Board\n‚Ä¢ https://amzn.to/2xESvGd [Affiliate Link]\n\nUSB Extension Cable (Optional, if you need the extra reach)\n‚Ä¢ https://amzn.to/2RWQUEL [Affiliate Link]\n\nArduino IDE for Mac\n‚Ä¢ https://www.arduino.cc/download_handler.php?f=/arduino-1.8.8-macosx.zip\n\nSkyNet3D anet-board Definition File\n‚Ä¢ https://github.com/SkyNet3D/anet-board\n\nKlipper Firmware:\n‚Ä¢ https://bit.ly/2sgoaeh\nThe Klipper project is 3d-printer firmware. There are two parts to this firmware - code that runs on a micro-controller and code that runs on a host machine. The host software does the work to build a schedule of events, while the micro-controller software does the work to execute the provided schedule at the specified times.\n\n\nDid this video help you out, save you a bunch of time, or help you learn something new?\nIf so, please consider becoming a channel member, or buying me a coffee, or leaving a tip! Your support really helps, and is VERY MUCH APPRECIATED!\n    ‚úÖ BV3D Channel Membership: https://youtube.com/bv3dchannel/join\n    ‚òïÔ∏è Buy Me a Coffee: https://www.buymeacoffee.com/5lKshEVvL\n    üëçüèª PayPal tip jar: https://www.paypal.me/bv3d\n\n*Ô∏è‚É£ The BV3D Channel Storefront on Amazon:\n    ‚Ä¢ https://www.amazon.com/shop/bv3dbryanvines\n\n*Ô∏è‚É£ Popular 3D printer affiliate links:\n    ‚Ä¢ Creality: https://shrsl.com/3qu2u\n    ‚Ä¢ Comgrow: https://bit.ly/33xcDtB [Check out the Creality REFURBS!] \n    ‚Ä¢ Elegoo: http://shrsl.com/3pu98\n    ‚Ä¢ FLSun: https://flsun3d.com/?ref=ifo73zup-gb\n    ‚Ä¢ Pergear: https://bit.ly/BV3Dpergear\n    ‚Ä¢ Sovol: https://bit.ly/3h90d2L\n    ‚Ä¢ Sunlu: https://bit.ly/3hGNzpQ\n    ‚Ä¢ Voxelab: https://bit.ly/3vVG9Wq\n\n*Ô∏è‚É£ In the market for a magnetic flexible build system for your 3D printer?\n    üí•Wham Bam Systems flex plates: http://bit.ly/2YzogLZ\n    As a Wham Bam Systems Associate I earn from qualifying purchases.\n\n*Ô∏è‚É£ Shop for just about anything:\n    üõíüá∫üá≤US: https://amzn.to/2x4hBxS [affiliate link]\n    üõíüá®üá¶Canada: https://amzn.to/2Ycb5ju [affiliate link]\n    As an Amazon Associate I earn from qualifying purchases.\n\nSOCIAL MEDIA\nFollow me on Twitter (@bryan_vines): https://twitter.com/bryan_vines\n\nDisclosure:\nI sometimes receive compensation such as discounted or free products, and when applicable, this is disclosed in videos and their descriptions. Whether free, discounted, or paid full price, any reviewed product is tested to the best of my ability, and I give my honest impression. All opinions expressed are my own.\n\n#AnetA8\n#Bootloader', '00:00:00', '3jm0zzIneFc', 'video/youtube', 'https://i.ytimg.com/vi/3jm0zzIneFc/mqdefault.jpg', '(min-width: