	(583, 583, '27MnEC7ejzs', 'What is the BEST fan for your Sidewinder X1 3d printer?', 'In this video i test 10 different fan and duct combinations to try to find the best setup for Part Cooling. I also test the flow of the 5020, 5015 and the stock 4020 fans and compare the weights of each setup. \nPlease like and Subscribe to the channel!\n\nhttps://www.facebook.com/EricksonsMandP/\n https://www.instagram.com/ericksonmap247\nericksonmap@gmail.com\nwww.iride247.com\n\n(Affiliate link)\n\nSidewinder X1\n\nGearBest\n\nAffiliate link Sidewinder X1 3d printer\n\nGearBest\n\nhttps://m.gearbest.com/3d-printer/pp_3001447641849895.html?wid=2000001&lkid=79412020\n\ncouponÔºöN4C0B46DE6DEB001\n\nFlex plates\nhttps://www.th3dstudio.com/product/ezflex2-flexible-print-system/?share=ericksonmachineperformance\n\nTh3d \nhttps://www.th3dstudio.com/shop/?share=ericksonmachineperformance\n\n#1  https://www.thingiverse.com/thing:3939198\n#2 https://www.thingiverse.com/thing:4151868\n#3 https://www.thingiverse.com/thing:3912303 ( Canal )\n#4 Stock \n#5  Duese_V5    https://www.thingiverse.com/thing:3989722\n#6  https://www.thingiverse.com/thing:3877344\n#7 https://www.thingiverse.com/thing:3912303 9   ( Canal_V1_1 ) \n#8https://www.thingiverse.com/thing:4077056\n#9  Modded ver. of #2\n#10  None\n#11  https://www.thingiverse.com/thing:3974220  ( ment for the BMG                        Which is why it didnt fit)', '00:00:00', '27MnEC7ejzs', 'video/youtube', 'https://i.ytimg.com/vi/27MnEC7ejzs/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCuYmw83Uj5DCICDRGIRlZeg', '2021-08-03 10:42:58', 198, '2022-10-25 01:03:51', '2022-10-25 01:03:51'),
	(584, 584, 'IK4td26k1vs', 'How To 3D Print Holographic Effect- With Any 3D Printer!!', 'In this video I will quickly show you how you can create a holographic finish effect on your 3D prints. All you need is a 3D printer and a diffraction grating sheet -  the specs of the one I used are 13,500 Lines/inch. I got mine from Amazon. They have several patterns available to choose from as well. Simply tape the film to the bed of your 3D printer and any surface of your 3D print will achieve the holographic effect. There are a few videos out there explaining the process more in depth but I just thought I\'d share my experience with it. \n\nHow many times will it work? I\'m not sure how many prints you can get before the film starts to wear down- comment below if you happen to have had more experience and would like to share. My guess is 10-20 quality uses before quality degrades. \n\nIf you found this video useful, like the video and I\'ll try and create more content like it. Thanks for watching!', '00:00:00', 'IK4td26k1vs', 'video/youtube', 'https://i.ytimg.com/vi/IK4td26k1vs/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCuYmw83Uj5DCICDRGIRlZeg', '2022-03-30 08:01:01', 198, '2022-10-25 01:03:51', '2022-10-25 01:03:51'),
	(585, 585, 'pgnVENykqW0', 'Realize the Full Power of Bigtreetech Boards by Using these Great Resources on GitHub and YouTube', 'This is the first in my ongoing series of 5-minute Tips and Tricks.\n\nIn this video, I discuss the various resources I use when I am working with Bigtreetech (BIQU) boards (https://www.biqu.equipment/search?type=product&q=bigtreetech). \n\nGitHub:\n\n- Bigtreetech - https://github.com/bigtreetech\n- Kersey Fabrication - https://github.com/KerseyFabrications/Marlin\n- TH3D Firmware - https://github.com/th3dstudio/TH3D-Unified-U1.R2\n\nYouTube:\n\n- Ed\'s 3d Tech - https://www.youtube.com/c/EdwardBraiman\n- Kersey Fabrications - https://www.youtube.com/c/KerseyFabrications\n- Chris\'s Basement - https://www.youtube.com/c/ChrisRiley\n\nIf you have any questions or comments, please post and I will get back to you soon as I can.\n\n#3dprinter \n#3dprinting \n#bigtreetech \n#3dprint \n#creality', '00:00:00', 'pgnVENykqW0', 'video/youtube', 'https://i.ytimg.com/vi/pgnVENykqW0/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCuYmw83Uj5DCICDRGIRlZeg', '2022-04-21 02:50:53', 198, '2022-10-25 01:03:51', '2022-10-25 01:03:51'),
	(586, 586, 'R0KudYq4T6g', 'Learn Blender for a CAD User - Part 1 - Simple Example in Fusion and Blender 3.0 #Fusion360 #Blender', 'In this video we are going to kick of a new series where we learn Blender modeling in Blender 3.0.  Over the years I have tried to learn Blender a few times by following tutorials and it just never seemed to stick to the point where I could recreate the project without the videos.  So through my experience learning Blender "my way" I wanted to pass on the approach of a user who knows CAD, specifically Fusion 360, and try to draw some common workflows between the two.\n\nIn this video we are going to talk about Parametric CAD, Modeling styles and then create a simple Form body in Fusion, and repeat the process in Blender.  We are going to work in Blender without any shortcut keys and we will take it extremely slow. \n\nFor this series I plan to take the time to really dive into certain tools, play with them before we tackle a project.  I don\'t know what that project is yet but it will be an attainable goal.\n\nBefore you get started you should have Fusion 360 and Blender installed and ready to go.  Blender is free and open source and you can download it here: https://www.blender.org/download/releases/3-0/\n\nFusion 360 has a Hobby license as well as a Commercial license.  For what we are doing the Hobby license will work just fine.  You can download a 30 day trial of Fusion 360 here: https://www.autodesk.com/products/fusion-360/free-trial\n\nThe end goal is to make you comfortable with Blender so you can tackle more complex projects without being overwhelmed.  Some Youtube \n\nChannels that I think do a great job with Blender:\n\nhttps://www.youtube.com/c/CGGeek - Unique style very knowledgable\nhttps://www.youtube.com/c/BlenderGuruOfficial - Tons of content good flow\nhttps://www.youtube.com/c/TheCGEssentials  -also has a fusion channel that seems to be geared to woodworking\nhttps://www.youtube.com/c/GrantAbbitt - overall great pace and info\nhttps://www.youtube.com/c/DECODEDVFX  - High level rendering and animation', '00:00:00', 'R0KudYq4T6g', 'video/youtube', 'https://i.ytimg.com/vi/R0KudYq4T6g/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCuYmw83Uj5DCICDRGIRlZeg', '2022-04-29 12:07:01', 198, '2022-10-25 01:03:51', '2022-10-25 01:03:51'),
	(587, 587, 'VALWsR5mkAo', 'Fixing the Artillery Sidewinder X1s (first) layer issue / Bed and V-roller replacement', 'Please consider subscribing to my channel!\nFollow me on Instagram: https://www.instagram.com/WF3Dprinting/\n‚¨áÔ∏è More info below! ‚¨áÔ∏è\n\nWhite and purple Filament I used:\n*eSUN PLA+ (Amazon GER üá©üá™ ): https://amzn.to/34fLmx1\n*eSUN PLA (Amazon US üá∫üá∏ ): https://amzn.to/3mdgrrp\n*eSUN PLA+ (Amazon UK üá¨üáß ): https://amzn.to/2FRtYoY\n\nBuy Prusament or Original Prusa printers here:\nhttp://shop.prusa3d.com/#a_aid=WF3D\n\nBed cable strain relief: https://www.thingiverse.com/thing:4092452\n\nA great guide to calibrate your Sidewinder X1: https://3dprintbeginner.com/artillery-sidewinder-x1-calibration-guide/\n\n\nüõíMy prop stores:üõí\nETSY Store: https://www.etsy.com/shop/wf3d/ \nCults3D Page: https://cults3d.com/en/users/WF3D/creations \n\n\nüåêMy social media:üåê\nTwitter: https://twitter.com/WF3Dprinting\nInstagram: https://www.instagram.com/WF3Dprinting/\nWebsite: https://www.WF3D.de\n\n* Links marked are affiliate links. These help me to keep this channel running by providing me with small kick back if you purchase through these links. This does not cause any extra cost for you. Thank you\n\n0:00 What issue has the printer?\n3:08 Replacing the bed\n4:22 Installing the strain relief\n4:53 Y-axis issue\n5:40 Replacing the V-rollers\n6:34 Result and explanation\n\n#SUBSCRIBE #3DPrinting #Sidewinder', '00:00:00', 'VALWsR5mkAo', 'video/youtube', 'https://i.ytimg.com/vi/VALWsR5mkAo/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCuYmw83Uj5DCICDRGIRlZeg', '2022-05-04 09:57:56', 198, '2022-10-25 01:03:51', '2022-10-25 01:03:51'),
