	(690, 690, 'sVbEyFZKgqk', 'Full PHP 8 Tutorial - Learn PHP The Right Way In 2022/2023', 'If you want to learn PHP the right way, then you are in the right place. In this course, you will learn PHP from beginners level all the way to advanced. The "right way" is subjective of course, but my goal is to teach PHP the way I would want to learn myself where important topics like security, caching, performance, configuration, routing, dependency management, dependency injection & testing are not omitted even when the course is for beginners. This course will not be only for beginners even though it will be beginner-friendly in the beginning. The course will be split into three sections. Each video will have a lot of details about the topic so even if you already know that topic I recommend watching it since you might learn something new.\n\nThis is the first video & it is an introduction to the course. I talk about what PHP is, why you should use it, how it works, and the overview of the course\'s main topics.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.0\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nDID YOU KNOW?\nPHP stands for PHP Hypertext Preprocessor which is a recursive acronym. You can read more about recursive acronyms here: https://en.wikipedia.org/wiki/Recursive_acronym', '00:00:00', 'sVbEyFZKgqk', 'video/youtube', 'https://i.ytimg.com/vi/sVbEyFZKgqk/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-11-21 04:32:00', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(691, 691, 'KgUp3FomMoc', 'How To Install PHP & What Are Web Servers - PHP 8 Tutorial', 'Let\'s set up the local development environment. We need PHP, a Web Server, MySQL & Code Editor. There are many ways one could install these, you could do it manually, you can use "all in one solution" like XAMPP / MAMP / WAMP or you could use a better alternative like virtual machines or Docker. In this video, I will be showing you how to get PHP up and running using XAMPP but in the second section, we will use Docker. In addition to setting up the local environment, you will learn what a webserver is & how it works.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.1\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nXAMPP - https://www.apachefriends.org/index.html\nSublime Text - https://www.sublimetext.com/\nAtom - https://atom.io/\nVSCode - https://code.visualstudio.com/\nPHPStorm - https://www.jetbrains.com/phpstorm/\n\nTABLE OF CONTENTS\n0:00 Intro\n0:19 What is a web server?\n1:19 Devtools to see requests\n1:57 Most common web servers\n2:18 Ways to install PHP in OS\n3:21 XAMPP drawbacks\n4:31 Installation for windows\n5:59 Testing if the web server is working\n6:29 htdocs\n7:52 Code Editors', '00:00:00', 'KgUp3FomMoc', 'video/youtube', 'https://i.ytimg.com/vi/KgUp3FomMoc/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-11-24 03:45:06', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(692, 692, 'HrtS-FkPBqk', 'Basic PHP Syntax - PHP 8 Tutorial', 'Let\'s write some PHP & go over the basic syntax. After this video, you will be able to concatenate & print text to the browser, declare & use variables, use variables within strings & embed PHP within HTML. In all of my videos, I cover a lot of small details that in my opinion are very important so I recommend watching the video fully. \n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.2\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nCHAPTERS\n00:00 Intro\n00:41 Basic Syntax\n01:58 Hello World\n03:22 Run PHP In Terminal\n03:50 Print vs Echo\n05:18 Escaping Quotes\n05:45 Variables\n06:26 $this variable\n06:48 Assigning by Value vs Reference\n07:45 Variables Within Text\n08:52 PHP In HTML\n10:45 Comments', '00:00:00', 'HrtS-FkPBqk', 'video/youtube', 'https://i.ytimg.com/vi/HrtS-FkPBqk/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-11-25 11:30:37', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(693, 693, '6JtP8xk1U_k', 'What Are Constants & Variable Variables In PHP - Full PHP 8 Tutorial', 'In this video, you\'ll learn how to define & use constants in PHP in two ways. You\'ll also learn what variable variables are & how to use them.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.3\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nPredefined Constants - https://www.php.net/manual/en/reserved.constants.php\nMagic Constants - https://www.php.net/manual/en/language.constants.magic.php\n\nCHAPTERS\n00:00 - Intro\n00:59 - Using define()\n01:28 - Constant Naming Rules\n02:00 - Print Constants\n02:23 - Check If Constant Has Been Defined\n03:05 - Using Const Keyword\n03:18 - Differences\n04:14 - Dynamic Constant Names\n04:49 - When To Use Constants\n05:03 - Predefined Constants\n05:38 - Magic Constants\n06:14 - Variable Variables', '00:00:00', '6JtP8xk1U_k', 'video/youtube', 'https://i.ytimg.com/vi/6JtP8xk1U_k/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-11-27 05:32:19', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(694, 694, 'KH4MmQsCDuw', 'PHP Data Types - Typecasting Overview & How It Works - Full PHP 8 Tutorial', 'Let\'s review the data types in PHP & typecasting. PHP does some magic when it comes to handling various data types. It\'s called type juggling. There will be individual videos for each of the types because I want to go into more detail & discuss some of the important things that otherwise would make this video too long. These small details are very important in my opinion because they will help you understand how things work in PHP what some may call "magic" when it comes to data types & casting.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.4\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nType Juggling - https://www.php.net/manual/en/language.types.type-juggling.php\nType Comparison - https://www.php.net/manual/en/types.comparisons.php\n\nCHAPTERS\n00:00 - Intro\n00:19 - Dynamically Types vs Statically Typed\n01:18 - Scalar Types (bool, int, float, string)\n03:05 - Get The Type Of The Variable (gettype, var_dump)\n04:25 - Arrays (Compound Types)\n06:19 - Null Type\n06:25 - Automatic Type Detection\n07:05 - Type Hinting Example\n08:22 - Type Juggling / Type Coercion\n10:15 - Strict Types\n11:12 - Type Casting', '00:00:00', 'KH4MmQsCDuw', 'video/youtube', 'https://i.ytimg.com/vi/KH4MmQsCDuw/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-12-01 01:55:46', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
