	(698, 698, '97LnEncGx2c', 'PHP String Data Type - Heredoc & Nowdoc Syntax - Full PHP 8 Tutorial', 'In this video, we go over the basic string syntax and multiline strings using Heredoc & Nowdoc syntax. I will show you when & why you would use heredoc & nowdoc syntax to define your strings.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.8\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nList of useful string functions - https://www.php.net/manual/en/ref.strings.php\nDetails about heredoc & nowdoc syntax - https://www.php.net/manual/en/language.types.string.php#language.types.string.syntax.heredoc', '00:00:00', '97LnEncGx2c', 'video/youtube', 'https://i.ytimg.com/vi/97LnEncGx2c/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-12-07 10:09:57', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(699, 699, 'XspbsepnhQ4', 'PHP Null Data Type - Full PHP 8 Tutorial', 'A short video about the NULL data type & how it is cast. It\'s a simple but very useful data type which you\'ll see in later videos.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments on videos, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.9\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-', '00:00:00', 'XspbsepnhQ4', 'video/youtube', 'https://i.ytimg.com/vi/XspbsepnhQ4/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-12-09 11:11:51', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(700, 700, 'C8ZFLq24g_A', 'PHP Array Data Type - Indexed, Associative & Multi-Dimensional Arrays - Full PHP 8 Tutorial', 'In PHP you can have regular index-based arrays also known as indexed arrays, you could also have arrays with custom keys also known as associative arrays & can have arrays within arrays which are called multi-dimensional arrays. You will learn all that you need to know about arrays to get started using them goes over how arrays are indexed by default & how re-indexing happens. Also, you will learn how to check if an element exists in an array at the specific key & the difference between array_key_exists & isset().\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.10\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nCHAPTERS\n00:00 - Intro\n00:43 - What are arrays\n01:27 - Indexed arrays & accessing elements\n03:06 - Undefined array key\n03:41 - Check if array key exists - isset()\n04:04 - Mutate arrays\n04:52 - Get length of array - count()\n05:04 - Add elements to an array - square bracket syntax\n05:37 - Add multiple elements to an array using array_push\n06:05 - Name your keys (associative arrays)\n07:11 - Add elements to associative arrays at specified keys\n07:45 - Multi-dimensional arrays\n10:02 - Duplicate keys & overwriting\n11:18 - Having keys on only some elements & how automatic indexing works\n12:05 - Removing an element from the end of an array using array_pop\n12:27 - Removing an element from the beginning of an array using array_shift & re-indexing\n13:14 - Removing element(s) from arrays by specifying keys using unset\n13:59 - Using unset() does not re-index arrays\n15:00 - Casting to arrays\n15:27 - Another way to check if the key exists in array & the difference between array_key_exists & isset()', '00:00:00', 'C8ZFLq24g_A', 'video/youtube', 'https://i.ytimg.com/vi/C8ZFLq24g_A/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-12-12 08:47:55', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(701, 701, 'bPntels5hw8', 'What Are Expressions In PHP & How They Are Evaluated - Full PHP 8 Tutorial', 'It\'s time to move on to expressions. Think of it as a new chapter in this course. Up until now, you have learned how to get PHP up & running, basic syntax, variables, constants, data types, casting & so on. However, almost everything in PHP is an expression & you\'ve already seen expressions in previous videos. Let\'s do a quick review of what expressions are & what will be the topics of the upcoming videos.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments on videos, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.11\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-', '00:00:00', 'bPntels5hw8', 'video/youtube', 'https://i.ytimg.com/vi/bPntels5hw8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-12-13 11:22:44', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(702, 702, 't8U2FGjjqM8', 'PHP Operators Part 1 - Full PHP 8 Tutorial', 'In this video, you will learn all about Arithmetic, String, Comparison & Assignment operators. You will learn things beyond basic because, in my opinion, things I discuss in this video are important to know which is why I decided to split it into two videos to not make it too long. The second video will cover the rest of the operators.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.12\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nRFC Discussing String To Number Comparison - https://wiki.php.net/rfc/string_to_number_comparison\nType Comparison Tables - https://www.php.net/manual/en/types.comparisons.php\n\nCHAPTERS\n00:00 - Intro\n00:47 - Arithmetic Operators\n04:35 - Assignment Operators\n07:12 - String Operators\n07:39 - Comparison Operators', '00:00:00', 't8U2FGjjqM8', 'video/youtube', 'https://i.ytimg.com/vi/t8U2FGjjqM8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-12-18 12:59:20', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(703, 703, 'gCVlQdbddXY', 'PHP Operators Part 2 - Full PHP 8 Tutorial', 'We continue with the rest of the operators in this video where you will learn error control operator (@), pre & post increment (++) & decrement (--) operators, array operators (+, ==, ===, !=, !==), logical operators (&&, ||, !, and, or, xor) with explanation on what short-circuiting is & how it works & bitwise operators (& | ^ ~) also explaining how to use bitwise operators & how it works.\n\nIn addition to the basic explanation of how to use these operators & how they work I also talk about some important things so I recommend watching the video fully.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments on videos, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.13\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nCHAPTERS\n00:00 - Intro\n00:11 - Error Control Operator (@)\n01:26 - Increment / Decrement Operators (++ --)\n03:17 - Logical Operators (&& || !)\n04:52 - Logical Operators (and or xor)\n05:45 - Logical Operators - Short Circuiting\n07:55 - Bitwise Operators (& | ^ ~)\n12:42 - Array Operators (+ == === != !==)\n15:32 - Execution Operator, Type Operator, & Nullsafe Operator', '00:00:00', 'gCVlQdbddXY', 'video/youtube', 'https://i.ytimg.com/vi/gCVlQdbddXY/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-12-21 02:03:27', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(704, 704, 'pmX_-x3LX-k', 'PHP Operator Precedence & Associativity - Full PHP 8 Tutorial', 'Operator precedence & associativity are very important topics to know because it can result in unexpected output when you combine multiple operators in an expression. Hoping that this video makes it clear how operations are grouped & what operator precedence & associativity are & how it works.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.14\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nhttps://www.php.net/manual/en/language.operators.precedence.php', '00:00:00', 'pmX_-x3LX-k', 'video/youtube', 'https://i.ytimg.com/vi/pmX_-x3LX-k/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-12-21 10:18:09', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(705, 705, 'PUWrc6vzRMw', 'Control Structures in PHP - Conditional Statements - if/else - Full PHP 8 Tutorial', 'It\'s time to learn control structures which you will use a lot in PHP and in any programming language. Control structures allow you to group multiple statements & execute them after a certain condition is met or keep executing them until some condition is met. They basically allow you to control the flow of the code execution. The first control structure that is covered in this video is if, else, & elseif conditional statements.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments on videos, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.15\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-', '00:00:00', 'PUWrc6vzRMw', 'video/youtube', 'https://i.ytimg.com/vi/PUWrc6vzRMw/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-12-27 12:15:43', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(706, 706, 'NhXvpHB_PMQ', 'PHP Loops Tutorial - Break & Continue Statements - Full PHP 8 Tutorial', 'Loops are simple but there are some important things that you need to be aware of when working with them, such as performance, things to be aware of when working with references, how to break out of nested loops, how to handle infinite loops & so on. Loop is basically a control structure that allows you to execute a block of code or multiple statements N times until a given condition evaluates to false or you manually break out of the loop. In this video, we cover while loops, do-while loops, for loops & foreach loops with examples on iterating over strings, arrays, and so on.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.16\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nCHAPTERS\n00:00 - Intro\n00:15 - While loop\n01:05 - Infinite loops\n01:32 - Break statement & use-case of an infinite loop\n02:05 - Break out of multiple levels of nested loops\n02:31 - Continue statement\n03:32 - Alternative while loop syntax\n03:47 - Do-While loop\n04:26 - For loop\n05:07 - Multiple expressions within for loop\n05:48 - Iterate over strings\n06:09 - Iterate over arrays\n06:23 - Performance concerns\n07:20 - Foreach loop\n08:38 - Overwriting array elements using assignment by reference\n09:15 - Something to be aware of - variable within the foreach loop is not destroyed\n10:30 - Iterate over associative arrays\n11:48 - Alternative foreach & for loop syntax', '00:00:00', 'NhXvpHB_PMQ', 'video/youtube', 'https://i.ytimg.com/vi/NhXvpHB_PMQ/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-12-29 11:07:16', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(707, 707, 'egDgLO8kvtI', 'PHP Switch Statement - Switch vs if/else statement - Full PHP 8 Tutorial', 'In this PHP tutorial you will learn about the switch statement in PHP, how to use it with examples, concerns when using switch statement within loops & the differences between the series of if statements & the switch statement. The switch statement is similar to if, elseif, else statements. The main difference is that the switch statement takes a single expression & compares its value against multiple values (cases).\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments on videos, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.17\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nCheck https://www.php.net/manual/en/control-structures.alternative-syntax.php for alternative syntax for the switch statement.\n\nCHAPTERS\n00:00 - Switch statement\n00:50 - Default case\n01:00 - Break statement within switch & how does switch statement work\n02:39 - Fall-through strategy & use-case of omitting the break statement\n03:28 - Loose comparison\n04:10 - Switch statement within loops & using break\n04:57 - Using continue statement within the switch statement that\'s within loop\n05:42 - Difference between switch statement & series of if statements (switch vs if). Demonstrating example of the performance difference', '00:00:00', 'egDgLO8kvtI', 'video/youtube', 'https://i.ytimg.com/vi/egDgLO8kvtI/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2020-12-31 05:00:55', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(708, 708, 'jCUyvHUKSmE', 'PHP Match Expression - Match vs Switch - Full PHP 8 Tutorial', 'In this PHP tutorial, you will learn about the newly added feature the match expression which was introduced in PHP 8. Match expression makes a block for switch statements much shorter & easier to read. You\'ll learn about the main differences between the match expression & switch statements with a real example. Do you like the match expression? Let me know your thoughts in the comments.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments on videos, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.18\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nCheck https://www.php.net/manual/en/control-structures.match.php for more info about match expression.', '00:00:00', 'jCUyvHUKSmE', 'video/youtube', 'https://i.ytimg.com/vi/jCUyvHUKSmE/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-01-02 12:54:12', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(709, 709, '6cPc_SEfgSw', 'PHP Return, Declare & Tickable Statements - Full PHP 8 Tutorial', 'In this PHP tutorial, you will learn about the declare & return statements. When the return is used within a function it stops the execution of the function & returns the value of the expression it\'s given, if no expression is given it will return null. If the return is used in the global scope (out of a function) then the execution of that script will end & will return the value of the expression or null if no expression is given. Declare statement is used to set execution directives, there are three directives: ticks directive, encoding directive & strict_types directive. \n\nThe reason I did not talk about the goto statement is that it just makes code harder to maintain & read. You can use other control structures to achieve the same result. If you still want to know how to use it, here is the link to the docs: https://www.php.net/manual/en/control-structures.goto.php\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.19\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nCheck https://www.php.net/manual/en/control-structures.match.php for more info about match expression.\n\nCHAPTERS\n00:00 - Return statement\n01:41 - Declare statement (ticks directive)\n03:22 - Declare statement (encoding directive)\n03:43 - Declare statement (strict_types directive)\n05:45 - Goto statement', '00:00:00', '6cPc_SEfgSw', 'video/youtube', 'https://i.ytimg.com/vi/6cPc_SEfgSw/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-01-03 09:53:20', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(710, 710, 'pQLO6l5lp-Y', 'How To Include Files In PHP - Include and Require - Full PHP 8 Tutorial', 'In this PHP tutorial, you will learn how to include PHP files with some actual practical examples. You will learn how to use output buffering to render a PHP file into a string using, how files are actually being loaded & located, the differences between require, include, require_once & include_once, & how to use include statements for code reusability. You will also learn a few things to be aware of when including files because again this flexibility & ease of use comes at a cost of possible bugs.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.20\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nCHAPTERS\n00:00 - Include & Require\n00:42 - Syntax\n01:00 - Difference between include & require\n01:30 - How are files located/loaded\n02:13 - Difference between include_once, require_once & include, require\n02:35 - Example usage of require_once with the variable being overwritten if the file is included more than once\n04:13 - Bad practice\n04:48 - Return value of include & using return within the included file\n05:27 - Using include within HTML for code re-usability\n06:59 - Including file into a string using output control functions (storing HTML of the included file in a string instead of printing it)', '00:00:00', 'pQLO6l5lp-Y', 'video/youtube', 'https://i.ytimg.com/vi/pQLO6l5lp-Y/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-01-07 03:49:08', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(711, 711, 'ba1rulfNhLk', 'How To Create Functions In PHP - Functions Tutorial - Full PHP 8 Tutorial', 'In this PHP tutorial, you will learn what functions are & how to create them. In addition to creating functions, you will learn about type hinting, return types, inner functions, union types & so on. In the next couple of videos, you will learn a lot more about functions & how you can use them properly so stay tuned.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.21\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nCHAPTERS\n00:00 - Functions\n00:36 - Creating functions\n01:10 - Return values from functions\n01:52 - Where to define functions\n02:14 - Declaring functions conditionally\n02:49 - Inner functions\n03:47 - Functions with the same name\n04:21 - Return types & strict types\n06:13 - Nullable types\n06:43 - Union types (type hinting multiple types)\n07:05 - Mixed type', '00:00:00', 'ba1rulfNhLk', 'video/youtube', 'https://i.ytimg.com/vi/ba1rulfNhLk/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-01-10 09:49:55', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(712, 712, 'I9XkWyets9w', 'PHP Function Parameters - Named Arguments - Variadic Functions & Unpacking - Full PHP 8 Tutorial', 'In this PHP tutorial, you will learn how to define parameters & pass arguments. You will learn how to unpack arguments using the splat operator & how to capture passed arguments into a single array using the splat operator. You will learn what the named arguments feature is and how to use it with examples. The named arguments feature was added in PHP 8.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.22\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nCoercive typing with union types - https://www.php.net/manual/en/language.types.declarations.php#language.types.declarations.union.coercive\nNamed arguments - https://www.php.net/manual/en/functions.arguments.php#functions.named-arguments\nRFC - https://wiki.php.net/rfc/named_params\n\nCHAPTERS\n00:00 - Function parameters\n00:19 - Define function parameters\n00:45 - Parameters vs arguments\n01:04 - Type hinting\n01:39 - Union types\n02:25 - Default values\n03:01 - Passing arguments by value vs by reference\n04:00 - Variadic functions - splat operator - capture passed arguments\n06:47 - Argument unpacking with splat (elipsis / three dot) operator\n07:39 - PHP8 named arguments', '00:00:00', 'I9XkWyets9w', 'video/youtube', 'https://i.ytimg.com/vi/I9XkWyets9w/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-01-13 05:31:48', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(713, 713, 'et1aVZWMvVE', 'PHP Variable Scopes - Static Variables - Full PHP 8 Tutorial', 'In this PHP tutorial, you will learn what variable scope is, global & local scopes, & more. You will also learn how you can use static variables to optimize your code & cache the value of expensive function calls.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.23\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nCHAPTERS\n00:00 - Variable scope\n00:25 - Global scope\n01:00 - Local scope\n01:41 - Using global keyword to access variables in the global scope\n02:12 - How are global variables stored & GLOBALS superglobal\n03:13 - Static variables', '00:00:00', 'et1aVZWMvVE', 'video/youtube', 'https://i.ytimg.com/vi/et1aVZWMvVE/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-01-15 05:05:38', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(714, 714, '7_FOIxYLF-s', 'Variable, Anonymous, Callable, Closure & Arrow Functions In PHP - Full PHP 8 Tutorial', 'In this PHP tutorial, you will learn the differences between variable functions, anonymous functions, callbacks & closures, and arrow functions. You will also learn another type in PHP called callable type.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.24\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nCHAPTERS\n00:00 - Intro\n00:20 - Variable functions\n01:49 - Anonymous functions\n02:38 - Closures & accessing variables from the parent scope\n03:53 - Callable data type & callback functions\n05:41 - Closure vs callable\n06:05 - Arrow functions', '00:00:00', '7_FOIxYLF-s', 'video/youtube', 'https://i.ytimg.com/vi/7_FOIxYLF-s/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-01-18 05:34:50', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(715, 715, 'Zf9MWSUKpVM', 'How To Work With Dates & Time Zones - Full PHP 8 Tutorial', 'In this PHP tutorial, you will learn how to work with dates & times in PHP, how to change time zones & various built-in date functions.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.25\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nDate Formats - https://www.php.net/manual/en/datetime.format.php\nTime Zones - https://www.php.net/manual/en/timezones.php\nRelative Formats - https://www.php.net/manual/en/datetime.formats.relative.php\n\nCHAPTERS\n00:00 - Intro\n00:22 - Working with Unix timestamp\n01:45 - Formatting dates\n03:03 - Working with time zones\n04:07 - Using mktime function to get Unix timestamp value\n04:31 - Parsing dates using function strtotime\n05:18 - Parsing dates using function date_parse & date_parse_from_format to get more details about date', '00:00:00', 'Zf9MWSUKpVM', 'video/youtube', 'https://i.ytimg.com/vi/Zf9MWSUKpVM/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-01-20 04:17:48', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(716, 716, 'E4FUeWa3WQk', 'How To Work With Arrays In PHP - Full PHP 8 Tutorial', 'In this PHP tutorial, you will learn how to work with arrays in PHP using various built-in array functions. You will learn how to merge, sort, map, filter, search, reduce, combine, chunk, destructure arrays & more.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.26\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nhttps://www.php.net/manual/en/ref.array.php\n\nCHAPTERS\n00:00 - Intro\n00:25 - Chunk an array into a list of smaller chunks of arrays - array_chunk\n01:15 - Combine arrays to form a new array - array_combine\n01:58 - Filter array - array_filter\n03:10 - Re-index array - array_values\n03:30 - Filter array with no callback - array_filter\n03:49 - Get keys of an array - array_keys\n04:33 - Iterate over array elements & apply callback - array_map\n06:10 - Merge arrays - array_merge\n07:10 - Reduce array to a single value - array_reduce\n08:35 - Search for a value in an array & find its key - array_search\n09:56 - Alternative way to check if an item exists in the array - in_array\n10:23 - Find the difference between arrays by comparing values - array_diff\n11:01 - Find the difference between arrays by comparing both keys & values - array_diff_assoc\n11:33 - Find the difference between arrays by comparing keys - array_diff_keys\n11:46 - Sort array by values - asort\n12:08 - Sort array by keys - ksort\n12:28 - Sort array by using custom function - usort\n13:19 - Array destructuring', '00:00:00', 'E4FUeWa3WQk', 'video/youtube', 'https://i.ytimg.com/vi/E4FUeWa3WQk/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-01-24 04:20:58', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(717, 717, 'LVEhccXXnOo', 'How To Work With PHPs Configuration File - PHP.INI - Full PHP 8 Tutorial', 'In this PHP tutorial, you will learn what the PHP configuration file is, what are some of the important settings & how to change them. The php.ini file is the settings or the configuration file for your PHP, each version can have its own php.ini. This file allows you to control how certain things in PHP work. You are able to also change some of the configuration settings at runtime by using ini_set.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.27\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nhttps://www.php.net/manual/en/ini.list.php\nhttps://www.php.net/manual/en/ini.core.php', '00:00:00', 'LVEhccXXnOo', 'video/youtube', 'https://i.ytimg.com/vi/LVEhccXXnOo/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-01-26 02:32:05', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(718, 718, 'rQntgj7yink', 'PHP Error Handling & Error Handlers - Full PHP 8 Tutorial', 'In this PHP tutorial, you will learn different types of errors in PHP as well as the basics of error handling. You will also learn how to trigger errors manually. This video is just an introduction to error handling to prepare you for a more advanced & in-depth video that will be coming out about error handling that includes exceptions in the second section of this course.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.28\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nhttps://www.php.net/manual/en/function.set-error-handler.php\nhttps://www.php.net/manual/en/errorfunc.constants.php', '00:00:00', 'rQntgj7yink', 'video/youtube', 'https://i.ytimg.com/vi/rQntgj7yink/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-01-30 02:57:45', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(719, 719, 'ytVPiYILz80', 'Basic Apache Webserver Configuration & Virtual Hosts - Full PHP 8 Tutorial', 'In this PHP tutorial, you will learn the basics of apache configuration files & how to work with them. You will also learn how to rewrite URLs using .htaccess files & the difference between .htaccess & httpd.conf files and why you should not use .htaccess files.\n\nNOTE\nAt 13:20 I copied htaccess content into vhosts config, if it does not work for you or you are setting rewrite rules globally then try the following instead:\n\nRewriteCond %{LA-U:REQUEST_FILENAME} !-f\nRewriteCond %{LA-U:REQUEST_FILENAME} !-d\n\nThe reason for it is because LA-U (look-ahead URL based) is needed for the proper value of REQUEST_FILENAME in some cases. More info on it can be read on https://httpd.apache.org/docs/current/mod/mod_rewrite.html (search for LA-U)\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.29\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nDefault locations of the apache configuration file by OS - https://cwiki.apache.org/confluence/display/HTTPD/DistrosDefaultLayout\nContext where the directives are allowed - https://httpd.apache.org/docs/2.4/mod/directive-dict.html#Context\nmod_rewrite - https://httpd.apache.org/docs/2.4/mod/mod_rewrite.html\nvirtual hosts - https://httpd.apache.org/docs/2.4/vhosts/\nvirtual hosts examples - https://httpd.apache.org/docs/2.4/vhosts/examples.html\n\nCHAPTERS\n00:00 - Intro\n00:38 - Apache configuration file - httpd.conf\n05:12 - Virtual hosts\n07:22 - .htaccess files', '00:00:00', 'ytVPiYILz80', 'video/youtube', 'https://i.ytimg.com/vi/ytVPiYILz80/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-02-04 04:02:19', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(720, 720, 'p7F2GgVxHc0', 'Working With File System In PHP - Full PHP 8 Tutorial', 'In this PHP tutorial, you will learn how to work with files & filesystem in PHP. You will learn how to create & delete directories, open files, put content, read content, read files line by line, read CSV files, some tips & things to be aware of such as return value caching for some of the file related functions.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.30\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nDocs for clearstatcache & list of affected functions - https://www.php.net/manual/en/function.clearstatcache.php\nDocs for fopen & modes - https://www.php.net/manual/en/function.fopen.php\nFilesystem functions - https://www.php.net/manual/en/ref.filesystem.php\n\nCHAPTERS\n00:00 - List of all files & directories - scandir\n00:44 - Check if file is a directory or a file - is_dir / is_file\n00:58 - Create & delete directories - mkdir / rmdir\n02:02 - Check if file or directory exists & print filesize - file_exists / filesize\n02:28 - Clear cached values of functions like filesize - clearstatcache\n03:30 - Open files & resource data type - fopen\n04:25 - Using error control operator to suppress warnings\n05:25 - Read files line by line - fgets / fclose\n06:25 - Read csv files - fgetcsv\n07:02 - Get file contents & store in a variable - file_get_contents\n07:57 - Write content to a file - file_put_contents\n08:50 - Delete, copy, rename & move files - unlink / copy / rename\n09:34 - Get information about a file - pathinfo', '00:00:00', 'p7F2GgVxHc0', 'video/youtube', 'https://i.ytimg.com/vi/p7F2GgVxHc0/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-02-08 03:33:59', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(721, 721, 'oXcX4ucj32M', 'Mini Exercise Project Overview - Full PHP 8 Tutorial', 'We\'ve reached the end of the first section of the course. Finally! This means that now we get to move on to more fun topics & actually work on a project. It may not seem so but we actually covered a lot of topics in this first section & there are a lot more tutorials/lessons on the way. There is a small exercise project that I will implement in the next video using things that we\'ve learned so far. The project that we\'ll be working on is going to be a simple budgeting/expense tracking application, but because we have not covered all the necessary things to implement this now we will slowly add on features as I cover the related topics. We will start with a simple file parser that reads one or multiply CSV files & extracts transactions from them.\n\nI really hope you enjoyed the first section of the course, please do let me know what you thought about it or if you have any kind of feedback. I have not recorded videos for the second section of the course yet & but will be recording them soon so it might be a couple of weeks before I start publishing videos for the second section of the course.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.31\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nPROJECT INSTRUCTIONS & REPO\nhttps://github.com/ggelashvili/learnphptherightway-project/tree/1.31', '00:00:00', 'oXcX4ucj32M', 'video/youtube', 'https://i.ytimg.com/vi/oXcX4ucj32M/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-02-11 03:25:03', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(722, 722, 'MOsolLaVnsI', 'Building Small Part Of The App With Procedural PHP - Full PHP 8 Tutorial', 'I implement the solution to the exercise project that was discussed in the last video. I tried to use the things that were covered so far in this course. In the second section of the course, we\'ll refactor this to object-oriented PHP. \n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 1.32\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nSOURCE CODE\nhttps://github.com/ggelashvili/learnphptherightway-project/tree/1.32', '00:00:00', 'MOsolLaVnsI', 'video/youtube', 'https://i.ytimg.com/vi/MOsolLaVnsI/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-02-14 09:36:54', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(723, 723, '1SujQeVK4MU', 'PHP OOP Tutorial Section 2 - Intro to Object Oriented Programming - Full PHP 8 Tutorial', 'This is the section of the course that will teach you Object-Oriented PHP the right way.  In this video, I do a quick review of what was covered, what will be covered & how OOP compares to procedural PHP.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.0\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-', '00:00:00', '1SujQeVK4MU', 'video/youtube', 'https://i.ytimg.com/vi/1SujQeVK4MU/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-02-26 09:31:53', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(724, 724, 'I_9-xWmkh28', 'PHP Docker Tutorial - Nginx - PHPFPM VS Apache - Full PHP 8 Tutorial', 'In this lesson, you will learn how to get PHP project up & running using docker. For the webserver, we\'ll be using Nginx because you already know how to set it up with apache & it\'s good to know both. I also talk about mod_php & php-fpm and towards the end of the video I discuss another alternative of XAMPP called Laragon.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.1\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nSource Repo - https://github.com/ggelashvili/learnphptherightway-project/tree/2.1\nInstall Docker - https://docs.docker.com/get-docker/\nInstall Docker-Compose (For Linux) - https://docs.docker.com/compose/install/\nNginx Config Docs - https://www.nginx.com/resources/wiki/start/topics/examples/full/', '00:00:00', 'I_9-xWmkh28', 'video/youtube', 'https://i.ytimg.com/vi/I_9-xWmkh28/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-03-03 04:06:43', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(725, 725, '6FW72q5fIx8', 'PHP Classes & Objects - Typed Properties - Constructors & Destructors - Full PHP 8 Tutorial', 'In this lesson, you will learn all about classes & objects in PHP. How to create classes & objects, set properties, typed properties, their visibility, create methods, learn about method chaining, what are constructors & destructors & so on. Make sure to watch it till the end since I cover some important things that you should be aware of when working with destructors.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.2\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nCHAPTERS\n00:00 - Objects & Classes\n00:56 - Creating class & object\n02:58 - Class properties\n04:43 - Typed properties\n07:50 - Class constructor, $this, & constructor arguments\n09:54 - Methods\n11:34 - Method chaining\n13:44 - Creating objects using variables\n14:05 - Creating multiple objects of the same class\n14:40 - Class destructor\n18:05 - stdClass & object casting', '00:00:00', '6FW72q5fIx8', 'video/youtube', 'https://i.ytimg.com/vi/6FW72q5fIx8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-03-08 05:07:21', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(726, 726, 'T1PbFz-o6kw', 'Constructor Property Promotion - Nullsafe Operator - Full PHP 8 Tutorial', 'In this lesson, you will learn a couple of new features that were added to PHP 8. It\'s related to the last video because we covered constructors in the last lesson & in this lesson, we\'ll cover constructor property promotion & null safe operator. \r\n\r\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.3\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\r\n\nRESOURCES\nConstructor Property Promotion RFC - https://wiki.php.net/rfc/constructor_promotion\nNull-safe Operator RFC - https://wiki.php.net/rfc/nullsafe_operator\r\n\nCHAPTERS\r\n00:00 - Constructor Property Promotion\r\n03:50 - Nullsafe operator', '00:00:00', 'T1PbFz-o6kw', 'video/youtube', 'https://i.ytimg.com/vi/T1PbFz-o6kw/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-03-10 11:00:58', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(727, 727, 'Jni9c0-NjrY', 'PHP Namespace Tutorial - Full PHP 8 Tutorial', 'In this video, you will learn all you need to know about namespaces in PHP. Not only you will learn the basics of namespaces, but if you watch this video till the end you will know a lot of important details about namespaces. There are some caveats & things to be aware of when working with namespaces. \n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.4\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nNamespaces Docs - https://www.php.net/manual/en/language.namespaces.php\nName Resolution Rules - https://www.php.net/manual/en/language.namespaces.rules.php\n\nHow does a name like \\my\\name or \\name resolve?\nhttps://www.php.net/manual/en/language.namespaces.faq.php#language.namespaces.faq.full\n\nHow does a name like my\\name resolve?\nhttps://www.php.net/manual/en/language.namespaces.faq.php#language.namespaces.faq.qualified\n\nHow does an unqualified class name like *name* resolve?\nhttps://www.php.net/manual/en/language.namespaces.faq.php#language.namespaces.faq.shortname1\n\nHow does an unqualified function name or an unqualified constant name like *name* resolve?\nhttps://www.php.net/manual/en/language.namespaces.faq.php#language.namespaces.faq.shortname2\n\nDefining Multiple Namespaces In The Same File\nhttps://www.php.net/manual/en/language.namespaces.definitionmultiple.php', '00:00:00', 'Jni9c0-NjrY', 'video/youtube', 'https://i.ytimg.com/vi/Jni9c0-NjrY/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-03-15 04:07:50', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(728, 728, 'rqzYdHdyMH0', 'PHP Coding Standards, Autoloading (PSR-4) & Composer - Full PHP 8 Tutorial', 'In this video, you will learn how to autoload your classes instead of using include & require statements. I\'ll show you how autoloader works, how to register custom autoloader & then how to use composer to handle autoloading for you. In addition to autoloading, you will learn about coding standards (PSR) and dependency management using composer.\r\n\r\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.5\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\r\n\r\nRESOURCES\nPSR-1 - https://www.php-fig.org/psr/psr-1/\nPSR-4 - https://www.php-fig.org/psr/psr-4/\nPSR-12 - https://www.php-fig.org/psr/psr-12/ \r\nSymfony Coding Standards Fixer - https://cs.symfony.com/\r\nPHP Code Sniffer - https://pear.php.net/package/PHP_CodeSniffer/\r\nComposer - https://getcomposer.org/\r\nVersioning - https://getcomposer.org/doc/articles/versions.md\r\nPHP Autoloading - https://www.php.net/manual/en/language.oop5.autoload.php\r\nPEAR Coding Standards - https://pear.php.net/manual/en/standards.php\r\nSymfony Coding Standards - https://symfony.com/doc/current/contributing/code/standards.html\n\nFor source, you can either use the code from https://github.com/ggelashvili/learnphptherightway-project/tree/2.1 as a starting base & build upon it following this lesson or you can use the one that\'s already built at the end of section 2 for exercise: https://github.com/ggelashvili/learnphptherightway-project/tree/2.33\n\nCHAPTERS\n00:00 - Autoloading\n05:52 - PSR\n10:27 - Composer & dependency management\n16:31 - Autoloading using composer', '00:00:00', 'rqzYdHdyMH0', 'video/youtube', 'https://i.ytimg.com/vi/rqzYdHdyMH0/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-03-19 04:52:09', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(729, 729, 'bEGNvUxYf2o', 'Object Oriented PHP - Class Constants - Full PHP 8 Tutorial', 'In the first section of the course, you learned how to work with constants in PHP. In this lesson, you will learn how to work with class constants, how to access them using the scope resolution operator & so on. I also show a good use case for it with a real example.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.6\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nVideo About Constants - https://youtu.be/6JtP8xk1U_k\nPHP 8.1 Enums - https://wiki.php.net/rfc/enumerations', '00:00:00', 'bEGNvUxYf2o', 'video/youtube', 'https://i.ytimg.com/vi/bEGNvUxYf2o/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-06-29 01:30:57', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(730, 730, '6VVN-2SCx7Q', 'Static Properties & Methods In Object Oriented PHP -  Full PHP 8 Tutorial', 'In the first section of the course, you learned about variable scopes & static variables. In this lesson, you will learn about static properties & methods of the class with some use cases including singleton & factory design patterns. There are few differences between static properties & non-static properties, one is that static properties are associated & belong to the class itself & not to any particular object, while non-static properties are associated & belong to the object. So when you create an object, that object gets fresh values for the non-static properties. Another difference is that you need to use the dollar sign when accessing static properties, unlike regular properties where you don\'t use the dollar sign to access non-static properties.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.7\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nVideo About Static Variables & Scopes - https://youtu.be/et1aVZWMvVE&t=193', '00:00:00', '6VVN-2SCx7Q', 'video/youtube', 'https://i.ytimg.com/vi/6VVN-2SCx7Q/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-03-25 06:02:39', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(731, 731, 'kA9BTNPFObo', 'PHP - Encapsulation & Abstraction -  Full PHP 8 Tutorial', 'This video covers two out of four Object Oriented Programming principles: encapsulation & abstraction. I cover how encapsulation & abstraction can be broken & some tricks to accessing private & protected properties and methods.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.8\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-', '00:00:00', 'kA9BTNPFObo', 'video/youtube', 'https://i.ytimg.com/vi/kA9BTNPFObo/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-03-30 05:21:31', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(732, 732, 'LyyzeYOoH5s', 'PHP - Inheritance Explained - Is Inheritance Good? -  Full PHP 8 Tutorial', 'Learn inheritance by examples not just by theory. Learn when inheritance is a good choice & when inheritance might not be ideal. Learn downsides of inheritance & why composition would be the better choice. Learn how to decide on choosing inheritance vs composition based on the relationship between the two classes.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.9\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-', '00:00:00', 'LyyzeYOoH5s', 'video/youtube', 'https://i.ytimg.com/vi/LyyzeYOoH5s/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-04-12 02:28:25', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(733, 733, 'UnwaW13xJuw', 'PHP Abstract Classes & Methods - Full PHP 8 Tutorial', 'In the previous lesson we covered inheritance, in this video, you\'ll learn about abstract classes & abstract methods. Abstract classes use inheritance so if you have not watched the last lesson about inheritance please make sure to watch that first since the same rules apply to abstract classes.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.10\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-', '00:00:00', 'UnwaW13xJuw', 'video/youtube', 'https://i.ytimg.com/vi/UnwaW13xJuw/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-04-15 08:28:42', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(734, 734, '-AJic0FjuAA', 'PHP Interfaces & Polymorphism - Interfaces Explained - Full PHP 8 Tutorial', 'In this video, you will learn interfaces & polymorphism in object-oriented PHP. With simple to understand & practical examples, this video will help you understand what interfaces are, how they should be used & what problems interfaces solve. In addition to learning interfaces & polymorphism, you will also learn what are some of the differences between interfaces and abstract classes.\n\nNOTE\n5:20 - Overriding constants from the interface is now allowed in PHP 8.1, this video uses PHP 8.0 where it was not allowed & resulted in an error. \n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.11\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-', '00:00:00', '-AJic0FjuAA', 'video/youtube', 'https://i.ytimg.com/vi/-AJic0FjuAA/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-04-20 07:01:12', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(735, 735, 'nCxnzj83poQ', 'What Are PHP Magic Methods & How They Work - Full PHP 8 Tutorial', 'In this video, you\'ll learn about PHP\'s magic methods, how they work & when they get called. Magic methods are exactly what they are called, they are "magic" in a way that you don\'t call these methods the way you call regular methods. Instead, these magic methods get triggered automatically after a certain action or event.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.12\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nLesson That Includes Constructors & Destructors - https://youtu.be/6FW72q5fIx8\nResources - https://www.php.net/manual/en/language.oop5.magic.php\n\nCHAPTERS\n00:00 - Magic methods\n00:49 - __get & __set\n05:21 - __isset & __unset\n07:45 - __call & __callStatic\n11:51 - __toString\n13:45 - __invoke\n15:08 - __debugInfo', '00:00:00', 'nCxnzj83poQ', 'video/youtube', 'https://i.ytimg.com/vi/nCxnzj83poQ/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-04-27 06:11:07', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(736, 736, '4W5t8g3Rp_0', 'What Is Late Static Binding & How It Works In PHP - Full PHP 8 Tutorial', 'In this video, you\'ll learn what early & late binding are as well as what late static binding is. By the end of this video, you will also know the problem with statics when it comes to inheritance & how late static binding solves that problem. \n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.13\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nLesson About Static Properties & Constants - https://youtu.be/6VVN-2SCx7Q\nResources - https://www.php.net/manual/en/language.oop5.late-static-bindings.php', '00:00:00', '4W5t8g3Rp_0', 'video/youtube', 'https://i.ytimg.com/vi/4W5t8g3Rp_0/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-04-29 06:59:59', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(737, 737, 'PMruqUC4Qpc', 'PHP Traits - How They Work & Drawbacks - Full PHP 8 Tutorial', 'In this video, you will learn all you need to know about traits in PHP with examples & in-depth explanations. You\'ll learn what problems traits solve as well as the problems it can introduce. \n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.14\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nhttps://www.php.net/manual/en/language.oop5.traits.php\n\nCHAPTERS\n00:00 - Intro\n00:27 - Multiple inheritance problem\n02:02 - Overview of coffee maker example in code\n03:08 - Using interfaces instead of multiple inheritance\n05:43 - Creating & using traits\n08:22 - How do traits work?\n08:39 - Method precedence\n11:02 - Conflict resolution ("insteadof" & "as" operators)\n13:38 - Changing visibility of trait methods\n16:02 - Composing traits from other traits\n16:46 - Properties within traits\n20:40 - Abstract methods in traits\n23:19 - Static properties & methods in traits\n25:38 - Magic __CLASS__ constant in traits\n26:13 - Personal opinion & downsides of traits\n28:46 - Example comparing inheritance & traits', '00:00:00', 'PMruqUC4Qpc', 'video/youtube', 'https://i.ytimg.com/vi/PMruqUC4Qpc/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-05-10 09:50:27', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(738, 738, 'zQ4Znj3RT3E', 'PHP Anonymous Classes - Full PHP 8 Tutorial', 'In this lesson, you will learn what anonymous classes are in PHP, how to create & use them. Anonymous classes like anonymous functions are nameless. You are able to create one-off objects using anonymous classes. You can either assign an anonymous class to a variable that will simply give you the object of that anonymous class, or just pass it as an argument since it\'s just an expression.\n\nNote that at 4:54 I copied constructor promoted properties & pasted them into the anonymous class. Promoted properties should not be used inside an anonymous class when you are extending from a base class since those already exist on the base class.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.15\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nAnonymous Classes RFC - https://wiki.php.net/rfc/anonymous_classes', '00:00:00', 'zQ4Znj3RT3E', 'video/youtube', 'https://i.ytimg.com/vi/zQ4Znj3RT3E/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-05-13 10:20:00', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(739, 739, 'zCGmZb3z-r8', 'PHP Variable Storage & Object Comparison - Zend Value (zval) - Full PHP 8 Tutorial', 'In this lesson, you will learn what happens when two objects are compared for equality with either comparison operator (==) or identity operator (===). You will also get an introduction of PHP\'s internals on what happens when variables are created, a brief introduction to zval (zend value) container, and so on.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.16\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nCHAPTERS\n00:00 - Object Comparison\n04:01 - How variables & objects are stored in PHP & what is zval (zend value) data structure\n07:21 - Circular relations & nested object comparison', '00:00:00', 'zCGmZb3z-r8', 'video/youtube', 'https://i.ytimg.com/vi/zCGmZb3z-r8/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-05-18 01:35:11', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(740, 740, 'hdDD0SNJ-pk', 'PHP DocBlock - Adding Comments to Classes & Methods - Full PHP 8 Tutorial', 'In this lesson, you will learn another type of comment called DocBlock which can be used to provide additional information about a class, method, property, constant, etc.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.17\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nhttps://docs.phpdoc.org/3.0/guide/guides/docblocks.html\n\nCHAPTERS\n00:00 - DocBlock\n00:48 - @param & @return tags\n02:29 - @throws tag\n02:54 - @var tag\n04:56 - @property & @method tags\n07:19 - Personal opinion/preference', '00:00:00', 'hdDD0SNJ-pk', 'video/youtube', 'https://i.ytimg.com/vi/hdDD0SNJ-pk/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-05-21 08:23:16', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(741, 741, 'vLmIoy6Bnog', 'PHP - Object Cloning & Clone Magic Method - Full PHP 8 Tutorial', 'In this lesson, you will learn how to clone objects & the magic method that gets called after an object has been cloned in PHP.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.18\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nLesson 2.16 Comparing Objects - https://youtu.be/zCGmZb3z-r8', '00:00:00', 'vLmIoy6Bnog', 'video/youtube', 'https://i.ytimg.com/vi/vLmIoy6Bnog/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-05-24 07:40:29', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(742, 742, 'Jnm2m_Iw5CI', 'PHP Serialize Objects & Serialize Magic Methods - Full PHP 8 Tutorial', 'In this lesson, you will learn what serialization is, how to serialize different types of values including objects, how to unserialize them & how to work with the given magic methods related to serialization. Covers __sleep & __wakeup as well as __serialize & __unserialize magic methods.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.19\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nLesson 2.16 Comparing Objects - https://youtu.be/zCGmZb3z-r8\nLesson 2.18 Object Cloning - https://youtu.be/vLmIoy6Bnog\nObject serialization RFC - https://wiki.php.net/rfc/custom_object_serialization\nDeprecating serializable interface RFC - https://wiki.php.net/rfc/phase_out_serializable\n\nCHAPTERS\n00:00 - Serialization\n01:12 - Serializing objects\n04:07 - Serializing boolean false & return false on failed unserialization\n05:11 - Magic methods intro & Serializable interface\n06:21 - __sleep & __wakeup magic methods\n07:44 - __serialize & __unserialize magic methods', '00:00:00', 'Jnm2m_Iw5CI', 'video/youtube', 'https://i.ytimg.com/vi/Jnm2m_Iw5CI/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-05-29 10:31:57', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(743, 743, 'XQ5Pd-6Hnjk', 'OOP Error Handling In PHP - Exceptions & Try Catch Finally Blocks - Full PHP 8 Tutorial', 'In the first section of the course, we covered error handling, in this lesson you will learn how to handle exceptions which are the OOP way of handling errors. You\'ll learn how to throw & catch exceptions, how to create custom exceptions. How to use exception handler, different types of exceptions & PHP\'s built-in errors, and so on.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.20\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nLesson 1.7 Float Data Type - https://youtu.be/d3c_OOD4Jzs\nLesson 1.28 Basic Error Handling - https://www.youtube.com/watch?v=rQntgj7yink\nSPL Exceptions - https://www.php.net/manual/en/spl.exceptions.php\nGlobal Exception Handler - https://www.php.net/manual/en/function.set-exception-handler.php\nError Hierarchy - https://www.php.net/manual/en/language.errors.php7.php\n\nCHAPTERS\n00:00 - What are exceptions\n01:15 - Throwing exceptions\n04:34 - Custom exceptions\n07:15 - Catching exceptions (try/catch)\n11:21 - Finally block & how return statements work from try, catch & finally blocks\n14:12 - Global exception handler, error hierarchy & changes in error reporting in PHP 7 & PHP 8\n17:50 - When to use exceptions\n18:49 - Domain-specific exception class with static methods to throw specific exceptions', '00:00:00', 'XQ5Pd-6Hnjk', 'video/youtube', 'https://i.ytimg.com/vi/XQ5Pd-6Hnjk/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-06-01 03:41:52', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(744, 744, 'hkTQkaFzEEo', 'PHP - DateTime Object - Full PHP 8 Tutorial', 'In this lesson, you will learn how to work with dates & times in Object-Oriented PHP using date classes such as DateTime, DateTimezone, DateInterval, DatePeriod, & DateTimeImmutable. You will learn how to add, subtract, compare & change dates as well as calculate differences. You will learn what to look out for and potential bugs when working with DateTime & DateInterval objects & how to solve such issues.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.21\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nLesson 1.25 Working with dates procedural way using date & time functions - https://youtu.be/Zf9MWSUKpVM\nLesson 2.16 Object Comparison & how objects are stored (zval container) - https://youtu.be/zCGmZb3z-r8\nCarbon PHP Library - https://carbon.nesbot.com/docs/\nDateTime docs - https://www.php.net/manual/en/book.datetime.php\nDocs for strtotime function & differences between dashes, slashes & periods when parsing dates -  https://www.php.net/manual/en/function.strtotime.php\nSupported date & time formats - https://www.php.net/manual/en/datetime.formats.php\nDate interval formats - https://www.php.net/manual/en/dateinterval.format.php\nDate interval construct (duration formats) - https://www.php.net/manual/en/dateinterval.construct.php\nDate period - https://www.php.net/manual/en/class.dateperiod.php\n\nCHAPTERS\n00:00 - Creating datetime objects\n01:21 - Working with timezones & formatting dates - setTimezone(), getTimezone(), format()\n03:43 - Change date & time on datetime objects - setDate(), setTime()\n05:53 - Create datetime objects from specific formats - DateTime::createFromFormat()\n10:28 - Compare dates\n11:43 - Calculate difference between two dates & DateInterval class\n16:03 - Add & subtract dates\n17:26 - Problem with DateTime object when modifying dates & times & how to solve it\n20:47 - Immutable datetime objects\n22:21 - Iterating over dates in a period - DatePeriod class\n24:34 - Intro to Carbon date library', '00:00:00', 'hkTQkaFzEEo', 'video/youtube', 'https://i.ytimg.com/vi/hkTQkaFzEEo/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-06-07 10:23:45', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(745, 745, 'QFPP9B-Q3zM', 'PHP Iterators & Iterable Type - Iterate Over Objects - Full PHP 8 Tutorial', 'In this lesson, you will learn what iterators are & how to work with them in PHP. It may sound scary but it\'s actually pretty simple. With iterators you can define how you want your objects to be iterated on, by default when you iterate over objects in PHP it will iterate on visible properties on the object but sometimes you may want to iterate on a specific property of the object instead. Learn what Iterator, IteratorAggregate & Traversable interfaces are, what iterable data type is & how to implement a basic collection pattern that you might be familiar with from frameworks like Laravel.\r\n\r\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.22\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\r\n\r\nRESOURCES\r\nhttps://www.php.net/manual/en/language.oop5.iterations.php\r\nhttps://www.php.net/manual/en/language.types.iterable.php\r\nhttps://www.php.net/manual/en/class.iterator.php\r\nhttps://www.php.net/manual/en/spl.iterators.php\r\nhttps://www.php.net/manual/en/class.iteratoraggregate.php\r\n\r\nCHAPTERS\r\n00:00 - Iterating over objects\r\n01:33 - Traversable, Iterator & IteratorAggregate interfaces\r\n02:11 - Implement simple collection class using Iterator interface\r\n07:50 - SPL iterators & refactoring collection to use IteratorAggregate interface\r\n10:26 - Iterable type & type-hinting', '00:00:00', 'QFPP9B-Q3zM', 'video/youtube', 'https://i.ytimg.com/vi/QFPP9B-Q3zM/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-06-10 06:28:52', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(746, 746, 'CF7Yy5cPFVM', 'PHP Superglobals - Basic Routing Using The Server Info - Full PHP 8 Tutorial', 'In this lesson, you will learn what superglobals are & learn the $_SERVER superglobal, how & when to use it, and so on. We will also build a basic routing using the information we get from the $_SERVER superglobal and we\'ll refactor & improve it in the next lesson where you will learn about $_POST, $_GET & $_REQUEST superglobals.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.23\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nhttps://www.php.net/manual/en/language.variables.superglobals.php\nhttps://www.php.net/manual/en/reserved.variables.server.php\n\nCHAPTERS\n00:00 - Superglobals & $_SERVER superglobal\n02:25 - Building basic routing', '00:00:00', 'CF7Yy5cPFVM', 'video/youtube', 'https://i.ytimg.com/vi/CF7Yy5cPFVM/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-06-14 05:55:06', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(747, 747, 'JdrvETQCAGw', 'Get & Post Superglobals In PHP - Forms - Post Routes - Full PHP 8 Tutorial', 'In this lesson, you will learn how to access the request data via $_GET & $_POST superglobals as well as the dangers of the $_REQUEST superglobal. We\'ll also improve the basic routing that we built in the previous lesson & add support for POST requests.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.24\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nhttps://www.php.net/manual/en/reserved.variables.get.php\nhttps://www.php.net/manual/en/reserved.variables.post.php\nhttps://www.php.net/manual/en/reserved.variables.request.php\n\nCHAPTERS\n00:00 - $_GET, $_POST & $_REQUEST superglobals\n06:28 - Improving router class to support post requests', '00:00:00', 'JdrvETQCAGw', 'video/youtube', 'https://i.ytimg.com/vi/JdrvETQCAGw/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-06-18 03:32:22', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(748, 748, '6vM-9ou1ARo', 'PHP Sessions & Cookies - Output Buffering - Headers Already Sent Warning - Full PHP 8 Tutorial', 'In this lesson, you will learn about sessions & cookies along with output buffering & the explanation of the well-known & common warning message "headers already sent".\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.25\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nhttps://www.php.net/manual/en/reserved.variables.session.php\nhttps://www.php.net/manual/en/function.session-start.php\nhttps://www.php.net/manual/en/reserved.variables.cookies.php\nhttps://www.php.net/manual/en/function.setcookie.php\nhttps://www.php.net/manual/en/book.outcontrol.php\nhttps://www.php.net/manual/en/function.header.php\nhttps://www.sitepoint.com/php-streaming-output-buffering-explained/\n\nCHAPTERS\n00:00 - Intro about sessions & cookies\n00:36 - Starting sessions, output buffering & what happens when sessions are started after output\n06:09 - Storing, retrieving, and deleting sessions & $_SESSION superglobal\n09:19 - Cookies & $_COOKIE superglobal', '00:00:00', '6vM-9ou1ARo', 'video/youtube', 'https://i.ytimg.com/vi/6vM-9ou1ARo/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-06-21 06:05:14', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(749, 749, '5PWGAC-mafU', 'PHP File Uploads - Full PHP 8 Tutorial', 'In this lesson, you will learn how to upload files in PHP, what $_FILES superglobal is & some of the php.ini directives related to the file uploads.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.26\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nhttps://www.php.net/manual/en/features.file-upload.post-method.php\nhttps://www.php.net/manual/en/function.move-uploaded-file.php\nhttps://www.php.net/manual/en/features.file-upload.php\nhttps://www.php.net/manual/en/features.file-upload.errors.php\nhttps://www.php.net/manual/en/features.file-upload.common-pitfalls.php\nhttps://www.php.net/manual/en/features.file-upload.multiple.php', '00:00:00', '5PWGAC-mafU', 'video/youtube', 'https://i.ytimg.com/vi/5PWGAC-mafU/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-06-24 07:50:04', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(750, 750, 'QiO0uUwOiBg', 'PHP MVC Pattern - View Parameters Exploit - Full PHP 8 Tutorial', 'In this lesson, you will learn what the MVC pattern is, how it works and we will implement the basic parts of the MVC pattern. We\'ll refactor our existing code from previous lessons to use controllers & then implement views. We\'ll explore how an attacker could exploit certain functions/approaches that developers may take to gain access to sensitive information like database credentials & so on.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.27\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nCHAPTERS\n00:00 - What is MVC\n04:30 - Implementing basic MVC (Controllers & Views)\n12:31 - Layout support (exercise)\n14:46 - Pass params from the controller to views using variable variables or extract function\n17:26 - Potential exploit with variable variables & extract function\n19:55 - Overview of Models\n21:02 - Where does validation belong, in Model or Controller?', '00:00:00', 'QiO0uUwOiBg', 'video/youtube', 'https://i.ytimg.com/vi/QiO0uUwOiBg/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-06-28 08:48:39', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(751, 751, 'W7tj0Qlk3rE', 'HTTP Headers In PHP - Request & Response Headers - Full PHP 8 Tutorial', 'In this lesson, you will learn the basics of HTTP headers, HTTP messages, HTTP response status codes, the structure of request & response, and more. We\'ll send a 404 status header when a non-existing page is visited, you\'ll learn how to redirect users & send appropriate headers to download a file.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.28\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nVideo About Sessions & Cookies - https://youtu.be/6vM-9ou1ARo\nhttps://www.php.net/manual/en/function.header.php\nhttps://developer.mozilla.org/en-US/docs/Web/HTTP/Headers\nhttps://developer.mozilla.org/en-US/docs/Web/HTTP/Status', '00:00:00', 'W7tj0Qlk3rE', 'video/youtube', 'https://i.ytimg.com/vi/W7tj0Qlk3rE/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-07-01 06:10:38', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(752, 752, 'mSnte-Ovm10', 'Intro To MySQL For PHP - Full PHP 8 Tutorial', 'In this lesson, you will learn the basics of MySQL because you will need MySQL to work on websites, web apps & the project in the third section of this course. This lesson covers just the very basics of MySQL, but that should be enough to get you started & prepared with databases & MySQL.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.29\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nVideo About Setting Up Docker - https://youtu.be/I_9-xWmkh28\nhttps://dev.mysql.com/downloads/workbench/\nhttps://dev.mysql.com/doc/refman/8.0/en/tutorial.html\nhttps://dev.mysql.com/doc/refman/8.0/en/data-types.html\n\nYou can use this source to see the Dockerfile & docker-compose (it\'s from lesson 2.33): https://github.com/ggelashvili/learnphptherightway-project/tree/2.33\n\nCHAPTERS\n00:00 - Intro\n00:59 - Install MySQL with Docker\n03:18 - Show list of databases & create a database\n04:06 - Using MySQL Workbench\n05:42 - Creating tables, running queries, foreign keys, joins, etc', '00:00:00', 'mSnte-Ovm10', 'video/youtube', 'https://i.ytimg.com/vi/mSnte-Ovm10/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-07-08 02:38:42', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(753, 753, 'wcD5HlEHrnc', 'PHP PDO Tutorial Part 1 - Prepared Statements - SQL Injection - Full PHP 8 Tutorial', 'In this lesson, you will learn how to connect to the database from PHP using PHP Data Objects or in short PDO. PDO provides data access layer abstraction where common methods can be used to interact with different databases like MySQL, SQLite, and so on. You will learn about prepared statements, what SQL injection is & how it works, how to prevent SQL injection, learn about the difference between binding params by value or by reference, the difference between placeholders & named parameters, emulated prepares & so on.\n\nNOTE: If you have concerns/questions about 15:28 please watch the beginning of Part 2 of the PDO lesson, I address & explain there. This is just a debug query & to save an extra line I decided to pass an integer directly to the query. I don\'t recommend you do that, even though this particular example has no SQL Injection vulnerability, someone might make a mistake & introduce the vulnerability. https://www.youtube.com/watch?v=e6yLUvpcOZo\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.30\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nhttps://www.php.net/manual/en/book.pdo.php\nhttps://www.php.net/manual/en/pdo.connections.php\nhttps://www.php.net/manual/en/pdo.error-handling.php\nhttps://www.php.net/manual/en/class.pdo.php\nhttps://www.php.net/manual/en/class.pdostatement.php\nhttps://www.php.net/manual/en/pdo.constants.php\nhttps://www.php.net/manual/en/ref.pdo-mysql.php\nhttps://github.com/php/php-src/blob/master/ext/pdo/pdo_stmt.c#L319\n\nCHAPTERS\n00:00 - Intro\n01:12 - Install/enable PDO MySQL\n02:45 - PDO connection\n05:52 - Error modes\n06:34 - Run queries & fetch data\n07:36 - Fetch modes\n09:14 - Prepared statements & SQL injection\n10:12 - SQL injection example\n13:43 - Placeholders, named parameters & the difference between them\n18:03 - Bind parameters using bindValue & bindParam\n22:18 - Emulated prepares', '00:00:00', 'wcD5HlEHrnc', 'video/youtube', 'https://i.ytimg.com/vi/wcD5HlEHrnc/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-07-16 05:37:27', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
	(754, 754, 'e6yLUvpcOZo', 'PHP PDO Tutorial Part 2 - Transactions - Env Variables & PHPDotEnv - Full PHP 8 Tutorial', 'In this lesson, we continue with the PDO & MySQL and learn about transactions. In addition to transactions, you will also learn where & how to store your database credentials using environment variables.\n\nSOME OF THE WAYS YOU CAN SUPPORT THE CHANNEL\nüëç Smash the like button\nü§ù Subscribe to the channel & turn the notifications on\nüí¨ Post comments, any feedback is greatly appreciated\n‚≠ê Become a Patreon: https://www.patreon.com/programwithgio\nTHANK YOU!\n\nLESSON 2.31\nCourse Outline - https://github.com/ggelashvili/learnphptherightway-outline\nCourse Playlist - https://www.youtube.com/playlist?list=PLr3d3QYzkw2xabQRUpcZ_IBk9W50M9pe-\n\nRESOURCES\nPrevious Video - https://youtu.be/wcD5HlEHrnc\nhttps://www.php.net/manual/en/pdo.transactions.php\nhttps://github.com/vlucas/phpdotenv\nhttps://dev.mysql.com/doc/refman/8.0/en/storage-engines.html\nhttps://dev.mysql.com/doc/refman/8.0/en/commit.html\n\nCHAPTERS\n00:00 - Intro\n04:23 - Database transactions\n08:35 - Transactions with PDO\n12:32 - Environment variables & phpdotenv package', '00:00:00', 'e6yLUvpcOZo', 'video/youtube', 'https://i.ytimg.com/vi/e6yLUvpcOZo/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCNoeG15U4pLBrFVHTw3xByw', '2021-07-26 07:14:35', 3, '2022-11-11 11:51:33', '2022-11-11 11:51:33'),
